INSERT INTO `organizations` VALUES (1,597205418013931,'Community Service Board of Middle Georgia','CSBMG',NULL,'The Community Service Board of Middle Georgia is dedicated to providing those we serve with quality innovative behavioral healthcare in a recovery-based environment.\n\nCurrently serving residents of Bleckley, Dodge, Johnson, Laurens, Montgomery, Pulaski, Telfair, Treutlen, Wheeler, and Wilcox counties in Georgia; and in our Ogeechee Behavioral Health  Division, serving residents of Burke, Emanuel, Glascock, Jefferson, Jenkins, and Screven counties in Georgia.',NULL,'https://csbmg.com/',NULL,NULL,NULL,NULL,NULL,'1191555915133824','1213931130954089',0,'6.393870977796837e32',NULL),(2,599571630068226,'Georgia Outreach LLC',NULL,NULL,'We provide outpatient mental health professional services including medication management. We are a team of psychiatrists, licensed individual and family psychotherapists and professional counselors who specialize in working with you to put the sparkle back in your eye and get your life back on track.\n\nOur office offers a wide array of services to suit your current need. Each provider brings their own unique way to providing care backed with years of training and experience.  Regardless of their professional back ground, each is committed to providing you with the care and treatment you need to get through your situation. \n\nHere are some of our general services offered in through our office. Please take some time to learn more about what we offer so that you can identify what best suits you when you contact us. If you do not see what you are looking for, or if you need some guidance please do not hesitate to contact our office.\n\nServices:\n&bull; Psychiatry Services\n&bull; Counseling and Pyschotherapy Services\n&bull; Military members and Family Services\n&bull; Anger Management Class\n&bull;  Professional Supervision ','admin@georgiaoutreach.com','https://www.georgiaoutreach.com/',NULL,NULL,NULL,NULL,'665886889631509,972810163775136,1128284577971511,928709026072445,1196348875106646,1184964434031522,638066563864909,854715304784835,963611626499494,908697606879147','1223764135647595','982008775481883',843893991634406,'6.393870977796838e230',NULL),(3,549646291248758,'Horizon Behavioral Health',NULL,NULL,'Our mission at Horizon Behavioral Health is to work together as a team with our patients, colleagues, and local community resources to design an effective treatment plan. We know that struggling with mental health can be a difficult and painful journey, which is why we work very hard to make your experience at HBH as seamless and as positive as possible.\n\nEstablished in 2011, Horizon Behavioral Health (HBH) is a private multidisciplinary practice providing psychiatric, psychological and therapy services. HBH has grown exponentially over the past five years and has three offices: Hinesville, GA, Savannah, GA and Rincon, GA. With over thirteen providers and twenty administrative staff members, we approach each patient with a team effort of highly skilled professionals.\n\nOur patients are the cornerstone of our practice and we do our best to ensure an exceptional experience from beginning to end. From initial intake to navigating insurance, HBH believes in supporting our patients so that they never feel alone on their treatment journey. With an average of 3000 appointments available per month, we are sufficiently staffed so that our new patients can secure an appointment within a short time frame.\n\nDue to our proximity to Fort Stewart and Hunter Army Airfield, a large portion of our patients are active or retired military and their families. *We accept TRICARE and are a proud provider of the Veterans Choice Program. We are honored to be able to play a role in helping to maintain the mental health of the local military community. With many of our staff members being military spouses or veterans themselves, we have a unique perspective on the challenges of military life.\n\nContact our office at (912) 785-2100 to find out more about our services and how we can help to provide you with a comprehensive treatment plan.\n\n*Spouses and Dependents of Active Duty Military, as well as Retirees and their Dependents,  may self-refer to Horizon Behavioral Health. Our staff will happily obtain all the necessary TRICARE authorizations for you.','lauren.francis@hbhca.com','https://www.hbhga.com/',NULL,NULL,NULL,NULL,'818680858884167','900571976097059,656611147381361','1274424241730282',1170898698427115,'6.393870977796837e32',NULL),(4,567977363172359,'Introspection and Reflection',NULL,NULL,'Community/Behavioral Health. Introspection & Reflection (INTROSPECTION & REFLECTION) is a behavioral health agency in Pooler, Georgia. Behavioral health centers are responsible for assuring the delivery of community based mental health, mental retardation, substance abuse and/or behavioral health services to individuals with those disabilities.','daysha@intospectionandreflection.com','https://npino.com/behavioral-health/1467990119-introspection-&-reflection/',NULL,NULL,NULL,NULL,'1102485622589090,1237880895794041,1087709025367769,1164222599422907,599597882500449,1161120721084526,1232506013258949,774196740439182,756893487433129,1062490828470003,912619755040973,1146803984504900,1140190333528863,1250626835757377,1238014271328139,980761626422654,792670772461033,945679371371732','785541576275303','958018420884621,813279413634666',1263119709592773,'6.393870977796838e176',NULL),(5,600407365797872,'Youth to Adult','Gateway Youth to Adult',NULL,'Youth to Adult is a grant funded program for young adults between the ages of 16-26 in Chatham County with a mental health and/or substance abuse diagnosis.  The goal is to increase the ability of the youth in reaching their mental wellness goals through connection to services, pro-social activities, mentoring, advocacy, trainings, or the purchasing of goods.','Jessica.Matthewson@Gatewaybhs.org','gatewaybhs.org',NULL,NULL,NULL,NULL,'789784875327216,1290678254463000,1349747894130010,864948508171522,773361741816558,854706604156595,1226301155203197,1085205995847522,758490426179837,1153266057059339,1186921701449622,1142975832670715,1262758221432560,1145622210762216,586082326327881,972689058438227,1255169956777175,551845419079871,815770613178352','922278812748597','1226130516229368',1234406032412710,'6.393870977796835e302',NULL),(6,628015162783225,'Nelson\'s Counseling and Wellness',NULL,NULL,'Offering individual, family, couples and group therapy. Other services include Anger Management, Pre-marital counseling and Grief therapy. CBT and DBT','Nelsoncounseling@gmail.com','https://www.facebook.com/pages/category/Medical---Health/Nelsons-Counseling-and-Wellness-518700551849277/',NULL,NULL,NULL,NULL,NULL,'979635528465297','939639665379994',867414241818820,'639387097779678',NULL),(7,732833359260751,'Georgia Health Partners LLC',NULL,NULL,'Referral form is attached. \n\nServices:\nIntensive Family Intervention (IFI)\nIndividual and Family Counseling\nCommunity Support and Behavior Assistance\nDiagnostic assessment\nMedication administration\nPsychosocial rehabilitation support\nCase management\nTrauma assessment\nCore Services\nLife Skills\nRelaxation therapy\nAddictive disease support services\nBehavioral and Mental Health Assessments\nPhysician and Nursing Assessments & Care\n24 hour Crisis Intervention','vhills@gahealthpartners.com','http://gahealthpartners.com/',NULL,NULL,NULL,NULL,'786963155137345,1134406084323176,991530878574874,580870708418367,952539516865852,1047672574683975,1155222326287335,764729445203401,1277964387940863,1222388189187290,1198315603303645,1253655118418992,1194806974194579,946069943040307,850960199917195,791600627648672,1108931960382734,1294319732267669,638360390196066,620176268587787,1222767982087690,1212502583702426,794388261984897,830863882415778,629883771341684,641389373878279,871133930539616,769147041617785,1024985483064273','1005138863537264','1052979040721473',818219667663604,'6.393870977796835e266',NULL),(8,763326334047675,'Access Mental Health Agency','AAMH',NULL,'For all new intakes, Access Mental Health Agency requires a picture ID of youth (if applicable) and parent.  Access Mental Health Agency is always taking new referrals.  They will make sure all intakes are scheduled within a few  days of the referral and will schedule same day if the client is in crisis. All clients who receive services at Access Mental Health Agency must participate in individual counseling.\n','www.accessmha.com','www.accessmha.com',NULL,NULL,NULL,NULL,'797330578618540,1088133066946676,616426655787255,1224272458547932,1280497114771204,1126187214917686,991185114255525,786923535112427,1248909646918812,549259632648700,726529029749501,939182269920838,648209324397950,806452579142295,954091525511900','637911491907869','776300774492735',1145634854238262,'7.915872864977079e158',NULL),(9,811252357472247,'Lookout Mountain Care Management Entity',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'0',NULL),(10,857524097390237,'William Immel, LPC',NULL,NULL,'Bill is a graduate of Rutgers University and has a Master&rsquo;s degree in Counseling from Rider University. He is licensed as a Professional Counselor by the State of Georgia and is a member of the American Association of Christian Counselors. Bill is also a Focus on the Family approved therapist. Bill has been providing individual, marital, family and group therapy for the past 22 years with areas of specialization including (but not limited to): anger management, divorce recovery, play therapy, depression, pornography addiction, and anxiety.\n\nBill and his wife Jennifer have two sons, Will and Rex.','barnabuscenter1@gmail.com','https://barnabascenter.net/counselors/',NULL,NULL,NULL,NULL,'1174887657190190,1349116493185139,903528354496310,1298533485310846,812561181026544,629036858950498,808174986791915,1297177713438027,871761684650388,651470224809588,808738243250166','1215259700414238','983268101472067',975971103048489,'0',NULL),(11,876471803286413,'Andrea Elam, MS,  LPC, CPCS',NULL,NULL,'She has experience working with children, adolescents, adults from various backgrounds; addressing: symptoms of depression, anxiety, domestic violence, schizophrenia, ADHD, bipolar disorders, and many other areas of their life.',NULL,'https://www.psychologytoday.com/us/therapists/andrea-elam-savannah-ga/139075',NULL,NULL,NULL,NULL,'675027633516806,893849833990829,641301072986701,756087323191427,623361355699074,1199510413822930,1184086548791552,878902471799811,812087851609256,1228511285779494','1157110391844305','918057918783910',746221124185236,'6.393870977796838e122',NULL),(12,830369986737903,'Adelle Burnsed-Geffen, PhD',NULL,NULL,'Narrative of Services:\nAround 50% of her clients have OCD. She treats other anxiety disorders as well as Mood Disorders, ASD, Personality disorders, and ADHD. She uses CBT, Exposure Response Prevention, and Mindfulness.  \nPlease provide medical referrals when appropriate.\n\nTraining Description:\nPh.D in Clinical Psychology, licensed in Georgia in 1985, and practicing independently since that time. Continued education through state and national psychological organizations as well as other approved medical education sponsors and peer supervision. Has treated OCD for at least 15 years children and adults.','psyctr1@aol.com ','https://iocdf.org/providers/burnsed-geffen-adelle/',NULL,NULL,NULL,NULL,'895303011170197,643093770371183,1144974170805706,608268734276411,640373764402297,1121075661202285,1180050922137770,1176909352604234','822775222771959','1226239597576850',1250505501130350,'1.213394553614195e87',NULL),(13,887938623409132,'Hope Counseling Center of Savannah',NULL,NULL,'CHILDREN/ADOLESCENTS\nFrom Early Childhood to Adolescents\nBased on their therapeutic needs, age, developmental level, personality and preference, your child&rsquo;s therapist will determine a uniquely individual treatment plan and counseling approach to use with your child. Therapeutic approaches may include talk therapy, play therapy, group therapy, or any combination of these.\n\nIndividual Counseling\nSocial Skills via Group Therapy\nProcess Groups for Teens\nSchool advocacy\nBehavior Modification\nBullying Prevention\nGrief and Divorce Recovery\nPlay Therapy\nAnimal Assisted Play Therapy\n\nADULTS\nA COMPREHENSIVE AND COLLABORATIVE APPROACH\nAdults working individually or in couples work are welcomed without judgment to explore their goals and concerns in a supportive and safe environment. Our approach with adults is collaborative and emphasizes hope as a catalyst for change and recovery.\n\nIndividual Counseling\nRelationship/Marital Counseling\nGrief and Divorce Recovery\nParenting/Co-parenting\nTraining & Workshops\n\nFAMILIES\nPRACTICAL AND SUPPORTIVE SOLUTIONS\nOur counselors support and assist families facing&#8232; life challenges, emphasizing effective problem solving and conflict resolution as well as improved communication.\n\nFamily Therapy\nGrief and Divorce Recovery','ndrea@hopecounseling.center','http://hopecounseling.center/',NULL,NULL,NULL,NULL,'958329775566528,1113734821017979,888789973087379,842619939184791,1207718502307140,759828826068865,1094992735362330,1091706527079197,1195374743023780,909009600976288,798009116393825,1283729751742050,1230124151001868,1270855693750638','1147034944508724,584003418223973','570937720530982,991433071763078',1045777867810878,'6.393870977796835e266',NULL),(14,903011084269923,'Melanie Mills, LPC, CACII,  ATR-BC',NULL,NULL,'Using a collaborative approach, she works closely with you to provide a positive therapeutic experience. With over 25 years of clinical experience, she provides for many different populations of adults, couples, families and children with the belief that change and healing is possible - no matter the past. She can work with you in a more immediate solution-focused way to address a crisis, or at a deeper level to meet goals for long-term issues. As a Certified Addictions Counselor for nearly 20 years, she emphasizes progress, not perfection, and incorporate a non-judgmental attitude for those affected by substance issues.\n\nShe utilizes an affirming, reality-based approach to counseling based on individual needs using Cognitive Behavioral Therapy, Solution Focused Brief Therapy, 12 Step, or stress management. In addition to talk therapy, She is a Board Certified/Registered Art Therapist and trained in Sandtray Therapy. Visual expression is a powerful tool for concerns difficult to verbalize.\n\nEMDR relieves trauma and anxiety reactions and has been invaluable in my work with military, their families and other survivors. Learn to change your thinking, manage your emotions and accept your best self. ',NULL,'https://www.psychologytoday.com/us/therapists/melanie-mills-savannah-ga/95453',NULL,NULL,NULL,NULL,'965258700302532,1289467219593544,1313405682659647,1170627377907579,1179477266867507,765367866528995,914062578437477,840886631262535,841580273971469,925807144511715,585297532083604,986061737033429,1189352224621513,920486887674778,639583385373977','1223963668955517','987312017916323',661564729925858,'6.393870977796835e302',NULL),(15,932661260333112,'Youth Advocacy Program','YAP',NULL,'Servicing Chatham County, Georgia, YAP began as a pilot program in 2011. As a collaborative effort with the Georgia Department of Juvenile Justice, Georgia YAP provides high fidelity wrap around services for juvenile offenders and since its start, has helped over 70 youth and families with 62% of youth not re-offending.\n\nOur services are individualized and tailored to meet specific needs of each youth. To enhance our program model, additional outcome based components are rendered to each youth as an added feature. The local program is under the leadership of a Director and our Advocates work hand-in-hand with each youth and family to ensure program success. Typically a youth is enrolled in the Georgia YAP program for a period of 6 months.\n\nExpansion for Georgia YAP is underway with growth in Chatham County and in other areas within the state.','lsimmons@yapinc.com','http://www.yapinc.org/georgia',NULL,NULL,NULL,NULL,'1062849280129466,889742572523970,595933869984534','1155064651413505','1114721937397983',1143267406656032,'1.2979198662606253e105',NULL),(16,888435226473868,'Malinda Graham and Associates',NULL,NULL,'Several Medicaid CORE services provided to consumers are:\n\nIndividual Counseling\nBehavioral Assistance \nFamily Training/Counseling\n24-Hour Crisis Intervention \nIntensive Family Intervention \nCommunity Support Individual\nSubstance Abuse Assessments and Treatment\nMedication Management\nDrug and Alcohol','khunter@mgrahaminc.com','http://www.mgacommunityservices.com/',NULL,NULL,NULL,NULL,'1139962080754296,778451438763707,852793073863382,1247688911751040,1327551367300583,1314453580233150,595380695669998','615255280057117','1197180011238880',882026281098116,'1.2979198662606252e213',NULL),(17,908935519698397,'Michael Lichtman, MD',NULL,NULL,'Dr. Lichtman works in Statesboro, GA and specializes in Child & Adolescent Psychiatry and Psychiatry. His specialties include Neurology and Psychiatry. \n\nStatesboro Psychiatric Associates, our approach to treatment is comprehensive, using a combination of medication, newer technologies, and therapy as appropriate.  Ours is a team approach in which our board certified Psychiatrists, Physician Assistant certified in psychiatry and addiction, and Psychologist, work closely together to personalize and individualize treatments to suit each person&rsquo;s specific needs.  As a practice, we aim to treat the whole individual as a person and not as an illness, as an individual and not a type or category. We are here to help optimize your health, address your very specific concerns, and reach your goals for good health.\n',NULL,'https://www.statesboropsych.com/',NULL,NULL,NULL,NULL,'1261725067843163,1267389878281054,911017547667235,1274254048131443,1303790461575309,1176765973692410,1217653065742674,1181549726934180,762138322106657,1122311955115051','911949867147692','827392117018258',1162485668871511,'6.393870977796838e176',NULL),(18,957645980497354,'The Barnabus Center for Counseling',NULL,NULL,'The Barnabas Center for Counseling offers Christ-centered, Biblically-based counseling. We provide individual, marriage, and family therapy. Our therapists are state licensed and are trained to work with children, adolescents and adults. We deal with a vast array of issues, among them: victims of physical, verbal, and sexual abuse; ADD, depression, marriage and parenting issues, anxiety, panic disorders, pre-marital counseling, child and adolescent issues. We also offer a reduced fee for those that qualify.\n\nThe Barnabas Center additionally offers workshops and retreats on a variety of topics ranging from marriage enrichment to parenting skills. For more information, contact our office.','barnabuscenter1@gmail.com','https://barnabascenter.net/',NULL,NULL,NULL,NULL,'880898903147313,779297977791926,1220986694133029,958396659173228,1264540540653000,1303266604785615,1044982877352438,753529343919874,645115599193062,720596635868327,650639919248244,1029065859025589,1227430762107303,1010212575988620,1179394335542154,1126004676730746','1275228658146727','785753978316869',882067443578248,'6.393870977796836e86',NULL),(19,999476238928145,'Heads Up Guidance','HUGS',NULL,'Heads-Up Guidance Services is a non-profit 501(c)(3) organization making Mental & Behavioral Health Counseling and Addiction Recovery Services available and affordable to ALL in need.\n\nMental Health, Addiction Recovery & Mentoring Services\nBehavioral Health Services\nSupport Groups for Family & Friends of Clients\nTeens & Adolescents\nFamily & Marriage Counseling\nWomen&rsquo;s Abuse/Trauma Group\nVocational Guidance & Career Development  Opportunities\nParenting Skills \nSpiritual Growth & Guidance\nSocial Skills & Recreational Therapy\nTraining in Life Skills & Financial Responsibility\n\nYouth Empowerment Services &ndash;  &ldquo;YES&rdquo; PROGRAM\nHUGS&rsquo; Counselors lead youth group discussions on topics important to their emotional health & social well being.  Group Sessions offered free of charge for clients between the ages of 12 and 18.','info@HeadsUpSavannah.org','http://www.headsupsavannah.org/',NULL,NULL,NULL,NULL,'757065747633368,885548940522194,1256929208936425,1276888661274574,785676709310814,960831124279739,950898296416929,1114048385632721,590353183444776','1287198807341402','1179109764528412',860772927661742,'6.393870977796836e86',NULL),(20,970550221345922,'Epact Inc',NULL,NULL,'EPACT, Inc. works to improve the social, psychological, educational and economic conditions of families and communities through the provision of evidence-based services and community collaboration.\n\n\nEPACT, Inc. believes strengthening individuals and  families through a collective provision of  opportunities that solidify the community connection is the best way to operate in their best interests and build strong, cohesive neighborhoods.\n\nEPACT, Inc. collaborates with other social services agencies, families, schools and the courts to educate and empower individuals to become self-reliant contributors to their communities.  Helping to sustain the bond between individuals, families and the community operates in the best interests of our children and creates a foundation of collective community empowerment.\n\nOUR SERVICES\nFamily Preservation\nOut-of-Home Suppor\nPost Permanency\nFamily-Time Visitations\nParent\'s Cafe\nNetworking Center\nParent Partners Corner\nFood and Nutrition Market\nHealthy Kids Tote\nHealthy Life-Choice Program\nClothes Closet\nFirst Impressions\nThe Kids Room\nIn-Home Services\nMental Health Services\nFamily Visitation\nParenting Education\nFinancial Education Services\nJob Readiness Skills\nTransportation Services\nFoster Care Development\nInternships','epact-inc@hotmail.com','https://www.epact-inc.com/',NULL,NULL,NULL,NULL,'593335372579968,1131608679473006,625530024663801,1103881312064906,1168468384481655,1103138929128897,694767085281719,957370874499589,1238086142110702,779946033510995,796335946705614','1262607973454058','606446291511615',828048791924989,'639387097779678',NULL),(21,1063946909176619,'Atlantic Counseling',NULL,NULL,'We offer a variety of counseling and therapy services to meet your needs, to include:\nIndividual and Family Therapy\nPTSD\nCoping with Deployment\nGrief Counseling\nTreatment of Anxiety and Depression\nCouples Counseling\nSubstance Abuse Services\nAddiction Services\nVictim Counseling\nTrauma Focused Brief Counseling','atlanticcounselingservices@gmail.com','https://www.atlanticcounselingservices.org/',NULL,NULL,NULL,NULL,NULL,'901206961205061','975897498556710',0,'639387097779678',NULL),(22,1094401029893949,'Viewpoint Care Management Entity',NULL,NULL,'High Fidelity Wraparound/Intensive Customized Care Coordination (IC3) creates a team with the consumer as the leader including people that already known to the family (and others we may choose together) to create one unified plan to reach your goals. Viewpoint partners the consumer to a Care Coordinator who will provide intensive in-home support, community linkages, safety and crisis planning, team building, and a customized plan of care. Additionally, the consumer is partnered with a DBHDD Certified Peer Specialist who serves as a peer support offering advocacy, education, skills building, and empowerment working towards a family vision for a healthy and successful life together. We focus on identifying and developing strengths of the youth, family, and supports to help the consumer remain with you in your own communities. \n\nEmail referral form to email address located at the bottom of the form and to Susan Gattman. ','Susan.Gattman@VPHealth.org','https://www.myviewpointhealth.org/about/programs-a-to-z/referrals/',NULL,NULL,NULL,NULL,'1118042117406396,583875789650488,1052903248171489,1099077382850779,852406902300408,801413377026488,655536717086863,763082242500132,1152649251270288,1189265669603422,606969333777979,1262676205960654,632544280592471,1103726882919440','1040192431403484','669861303410140',1095457030682112,'6.393870977796837e50',NULL),(23,1066063275223463,'Kristin Fahey Counseling & Consulting',NULL,NULL,'Addiction & Substance Use Disorder, Social Worker - Clinical. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'777491857913804','1174565888439620',775625383874928,'6.393870977796837e32',NULL),(24,1066842143635008,'Joye Psychology and Associates',NULL,NULL,'We provide comprehensive diagnostic assessments and therapy for children, adolescents, and adults in Chatham County and the surrounding areas. \n\nASSESSMENT SERVICES\nWe offer personalized, comprehensive assessments in the following areas for children and adults: * Gifted and Talented * Kindergarten Readiness * Learning Disability * Academic Achievement/Grade-Level Readiness * College Academic Readiness * Attention-Deficit/Hyperactivity Disorder (ADHD) * Autism Spectrum Disorder and other developmental disorders (as young as 18 months old) * Intellectual Functioning * Mood Disorders * Anxiety Disorders.\n\nFor all grade-level assessments, we conduct differential diagnosis and offer written recommendations about school placement and accommodations as well as ways to work with your child or teen at home to maximize his or her success. For college-level assessments, we include in our reports recommendations aimed at maximizing the student\'s success. As needed, we can also provide IEP/504 Plan support, including attending school meetings.\n\nAssessment Procedure:  Assessments typically consist of an intake appointment, during which we will decide what testing is needed and agree on a price, a testing session, and a feedback session. Depending on your needs, testing can be divided into multiple sessions. \n\nTHERAPY SERVICES\nFor children and families: We offer therapy for issues including (but not limited to): * disruptive behavior disorders * academic problems * ADHD * Autism Spectrum Disorder * anxiety, fears, and phobias * noncompliance * tantrums. We also offer groups for children and their parents, including expressive arts, social skills, and parenting/support groups using a 1-2-3 Magic framework (123magic.com). \n\nSummer Camps: In mid-July, we will offer theme-based social skills camps for rising 1st through 5th graders. Groups will be small (6-8 children), last for one week, and engage children to learn social skills using Legos, magic, comic books, expressive arts, and other fun activities. Space is limited, so please let us know now if you are interested! \n\nSocial Skills Groups: Like our summer camps, social skills groups focus on learning social skills in a fun and engaging context. Currently, we have a Daniel Tiger group for 4-6 year old children, and we plan on continuing to add more ages as grow. Please sign up for our newsletter - we will announce new groups as they are scheduled! \n\nFor adults: We offer treatment for individuals and couples for a range of presenting issues, including: * depression * anxiety * interpersonal/relationship problems * adjustment issues * transition to college * issues related to self-esteem * gender/sexual identity * trauma. We hope to soon offer meditation groups for adults as well. \n\nFor all services: We use primarily evidence-based cognitive behavioral therapy for children and adults, which is problem focused and goal directed. Most issues can be effectively addressed in a short period of time (6 to 12 sessions). Treatment type and duration time will be individualized to meet the needs each patient. &#8203;\n','emorrissey@joyepsyc.com','http://www.joyepsychology.com/',NULL,NULL,NULL,NULL,'972531665188637,1016203787587097,737365129476694,786790323113279,1238724545558502,1032378597509972,1131917794107517,746725697673984,1139681227923519,812372985815046,789240775906708,793602695935014','909316241133034','624872025396095',937632561206587,'6.393870977796838e122',NULL),(25,1108209842099732,'May Institute',NULL,NULL,'May Institute is a nonprofit organization that is a national leader in the field of applied behavior analysis, serving individuals with autism spectrum disorder and other developmental disabilities, brain injury and neurobehavioral disorders, and other special needs.\n\nFounded nearly 65 years ago, we provide a wide range of exceptional educational and rehabilitative services across the lifespan.\n\nThe organization is one of the largest and most well-respected providers of services and special education schools for children and adults with autism and other special needs in Massachusetts and in the U.S.\n\nMay Institute has evolved into a national network that serves thousands of individuals and their families annually. With corporate headquarters in Randolph, Mass., the organization operates more than 140 service locations in more than a dozen states across the country.','hthomas1@mayinstitute.org','https://www.mayinstitute.org/',NULL,NULL,NULL,NULL,'1247508787852806,666336191102649,1211474768083870,601764966348736','1181452283889795','587796586661919',1325952759579779,'6.393870977796837e32',NULL),(26,1112271443337891,'The Clubhouse',NULL,NULL,'The Clubhouse offer Seven Challenges curriculum, Moral Reconation Therapy (MRT). Disability services may be available for youth up to age 18 through a referral from DBHDD (912-303-1649). The Clubhouse is a substance abuse recovery model. ','alexander.buchanan@gatewaybhs.org','gatewaybhs.org/',NULL,NULL,NULL,NULL,'821443118433051,926415475412230,576659649705800,898434683684765,1179395636985303,642977764747406,1308672176210939,1016659307668315,1174639128056361,971533152322019,897211298036523,793116759676495,1079187118579689','854685172508860','754649737705617',959714851720583,'1.2979198662606254e159',NULL),(27,1188157508639868,'Savannah Counseling Services (Gateway)',NULL,NULL,'Gateway Community Service Board charges based on a sliding fee scale in accordance with Georgia\'s Department of Behavioral Health and Developmental Disabilities Policy. The fee scale is based on family income and ability to pay. No one will be denied access to services due to inability to pay. Gateway also accepts Medicaid, WellCare, Amerigroup, and some private insurance. \n\nGateway also does not accept referrals but there is an Open Access held every day, Monday-Friday, from 8:30am to 10:00am. Consumers will need to pre-register by calling 1-866-557-9955. ','delphina.greene@gatewaybhs.org','https://www.gatewaybhs.org/',NULL,NULL,NULL,NULL,'661525491665323,656998288924627,757062004010689,963680998044973,817453176806210,620477656631858,1206754953879974,888441195070957,969029535713516,1080540093132960,819797477929725,915933284463785,952153730113257,950703310225408','1055462335344100','1046407159111348',946854070779016,'1.2979198662606255e195',NULL),(28,1209156844866073,'Southeast Second Chance',NULL,NULL,'Southeast Second Chance, Inc. was formed in 2007 to serve individuals, couples, and families with an array of life problems. The philosophy of the practice is to empower individuals to cope with, and solve, their problems, accentuating their strengths and unique capabilities. Cognitive-behavioral, relapse prevention and solution focused techniques are used to help people move on with their lives as quickly as possible. SESC treats all types of problems including depression, anxiety, substance abuse, major mental health disorders, issues related to development, including divorce, family reunification, aging, and young families with children and adolescents. These services include individual, couples, family (child and adolescent) services, mental health and psychological evaluations.\n\nForensic Services include court ordered evaluations and treatment as well as specialized mental health, parenting, problem sexual behavior, and domestic violence issues. Specialists offer evaluations and comprehensive treatment services to juveniles and adults dealing with problematic sexual behaviors. Services are encouraged for people who are not involved in the legal system. For our staff, ongoing training, ethical and resource development are an integral part of the program. Treatment groups are held weekly in Savannah, Brunswick, and Woodbine.','www.southeastsecondchance.org','http://southeastsecondchance.org/',NULL,NULL,NULL,NULL,'829505483461395,1217496146589403,1197184944425601,671169073373736,1052487890195985,1209054562671972,1189487759432955,711998778361678,1186937467199346,883427021420284,611908241458361','1206688914761370','539012621432586',1275874278517679,'6.393870977796835e248',NULL),(29,1271207565206427,'Recovery Place Inc',NULL,NULL,'Recovery Place was first established in 1984 as a treatment center for Savannah, GA residents to get the care they need for drug abuse, alcoholism, and behavioral health conditions. Recovery Place has since become fully accredited by the Commission on Accreditation of Rehabilitation Facilities (CARF) and has been named a best practices model facility as well.\n\nOur team of qualified clinical and medical professionals provide comprehensive care to help people get the attention and services that they need &ndash; all in our tranquil and comfortable rehabilitation facility. There is a wide range of treatment options for clients to choose from, including outpatient, partial hospitalization, or residential services, depending on your individual situation.\n\nSince 1984, we have helped over 20,000 people achieve recovery and better their lives through the therapy, medical attention, case management support, and additional services that Recovery Place offers. We want to help you get your life back and gain the confidence to succeed. We use a strengths-based approach with a fully licensed and caring staff.\n\nMeet Our Caregivers','jchisholm@recoveryplace.org','https://recoveryplace.org/',NULL,NULL,NULL,NULL,'968294971285337,772967945034549,1089514628486887,1161965191059829,816199783859795,1074431436174284,785506763080308,623183571206948','891022590186155','572222951228384',1329779272841786,'6.393870977796838e122',NULL),(30,1258030347645238,'Q and R Consultation Services, LLC',NULL,NULL,'Q & R Consultation Services provides counseling services for individual, group and family therapy for children, adolescents and adults.','qandrconsultation@gmail.com','https://www.facebook.com/qandrconsultationservicesllc/',NULL,NULL,NULL,NULL,'643738643666298,758995334970369,1067510085832084,1146598424073431,1288039132023961,873705694105417,609850777110881,608877623507879,851443816753761,1165817063888189,987129668562491,954442888323940','1280430268019655','712300758206965,1039507544346750',1291078742541334,'6.393870977796837e194',NULL),(31,1241524558231705,'C. Williams and Associates',NULL,NULL,'MENTAL HEALTH COUNSELING\n\nMEET OUR PROVIDERS:\nCORI WILLIAMS,  LPC -  She has extensive experience treating individuals with anxiety, depression and attachment issues. She is most passionate about advocating for individuals with developmental disabilities and their families.  She specializes in counseling individuals with developmental disabilities and autism. She strives to help them build their lives to their fullest potential.  She uses mindfulness, art and play within her practice to decrease anxiety in the clients she serves. She is willing to meet outside of the therapy office, in the most comfortable setting for the client.\n\nCHRIS WILLIAMS, LPC - He has experience treating individuals with depression, anxiety, as well as couples counseling. His experience in the mental health field began in 2003 and has worked with a variety of individuals dealing with a wide range of issues. His passion is working with couples dealing with communication difficulties, trust issues, as well as parenting style differences. He focuses on the individual as a whole and use a wide range of modalities such as Cognitive Behavioral Therapy, Person Centered, and Seven Challenges for adolescents. His goal is to meet each client where they are in the treatment process and provide individualized treatment planning to maximize your potential!\n\nNINA KENNEDY, LMFT - She works with individuals, couples and families of all ages. She specializes in depression/anxiety, marital issues, child behavioral issues, LGBTQ, and substance abuse. She is highly proficient in working with both voluntary and involuntary assessment and treatment. She has recently been voted 2018 Savannah\'s Best of the Best Therapist/Psychiatrist by Savannah Morning News. She believes people come to therapy because they want help. They want something to be different. She feels it is her place to help someone identify that and find ways they feel will get them where they want to be. \n\nJENN BOYD, LPC -  She has experience working with youth, adults, and families on a variety of different issues including suicidality, self harm, anxiety, depression, difficulty regulating emotions, and trauma. She utilizes a person-centered style of therapy, based on each individuals\' needs and have been trained in Dialectical Behavioral Therapy as well as Trauma Focused Cognitive Behavioral Therapy.  She strives to provide a safe environment to explore personal issues while also teaching skills to help manage overwhelming emotions and seek solutions. She enjoys incorporating mindfulness and other techniques into therapy to help implement these strategies, ultimately helping people learn the skills to become in control of their feelings and behaviors.  When one feels more in control of their emotions and the ability to tolerate distress, it can be easier to deal with the inevitable challenges we face.','www.cwilliamsandassociates.com','https://cwilliamsandassociates.com/',NULL,NULL,NULL,NULL,'1221393317742498,1114588401118075,755091768096158,981672087636212,1306629208084828,814332423375087,1155458231532259,1111870450014760,1174846800463588,1079005824719955,638816317331342,864963889079138,857548956708557,631764041292671,688939795633989,813223569385996,791623753446401,1077576676574364,908597878326458,916086599181705,1130706060335841,1240593533847484,1245003406510332,1272261512477246,910998195780879,992405855317420,832180067546085','1122969038292767','1276050815212765',1246039041277873,'0',NULL),(32,1264014271336859,'J C Lewis Primary Health Care Center',NULL,NULL,'J.C. Lewis Behavioral Health program provides comprehensive behavioral health services  to  consumers of J C Lewis medical or dental  program.',NULL,'http://www.jclewishealth.org/services/behavioral-health-care-services/',NULL,NULL,NULL,NULL,'611399754752479,622700357906961,872806759635513,831634114767364,875291947118436,1254802746918209,1057210939189988,841490201793930,807871774073250,1199400635043101','1199373240119152','1342101724204403',656232573636886,'0',NULL),(33,1289247967843300,'Katherine Mckenzie, LPC',NULL,NULL,'Katherine D. McKenzie LPC is a female counselor in Savannah, GA.',NULL,NULL,NULL,NULL,NULL,NULL,'839236359897533','1253884668561909','873298214845556',1122887222515225,'6.393870977796837e50',NULL),(34,1264690864853116,'Ashley Richbourg, LCSW',NULL,NULL,'Ashley Richbourg , LCSW is a licensed clinical social worker with a Masters of Social Work from the University of North Carolina at Chapel Hill. Ashley brings years of experience as an in-home individual & family therapist working with couples to strengthen and improve relationship skills. She now focuses her experience on providing solution based therapy to a range of clients with many different issues. She specializes in working with individuals and couples who are determined to focus on their strengths and build towards a better future.',NULL,'https://www.georgiaoutreach.com/therapists-3/ashley-richbourg-lcsw/',NULL,NULL,NULL,NULL,'976119897634314,587115215775275,1155704876769910,1150840648569071,1128133958317930,1306972062481466,575100700886576,1142633869969983','1000710924307359','574794009437158',848899122442716,'6.393870977796836e86',NULL),(35,1306784019365289,'Judy Saucerman, LCSW',NULL,NULL,'Judy Saucerman, LCSW is a licensed clinical social worker with over 20 years of experience doing therapy in outpatient, inpatient, substance abuse, forensic, agency and military clinics.  Wanting to know you and what you really need drives her interest in providing your therapy. She will guide you in exploring the real you, and helping you make sense of your thinking and decisions helps you arrive at new clarity and peace. Judy&rsquo;s years of experience and training will be utilized to help you learn the coping skills and tools to deal with what&rsquo;s bothering you.\n\nOur office offers a wide array of services to suit your current need. Each provider brings their own unique way to providing care backed with years of training and experience.  Regardless of their professional back ground, each is committed to providing you with the care and treatment you need to get through your situation. \n\nHere are some of our general services offered in through our office. Please take some time to learn more about what we offer so that you can identify what best suits you when you contact us. If you do not see what you are looking for, or if you need some guidance please do not hesitate to contact our office.\n\nServices:\n&bull; Psychiatry Services\n&bull; Counseling and Pyschotherapy Services\n&bull; Military members and Family Services\n&bull; Anger Management Class\n&bull;  Professional Supervision ',NULL,'https://www.georgiaoutreach.com/',NULL,NULL,NULL,NULL,'1114917771374002,807009975519046,864777942063090,741526213627661,639080353826117,844974435726986,765904827589658,1210492616347569,944937577356564,617465678285624,975796055697669','946390674647798','766114163250573',1021481825385959,'6.393870977796837e50',NULL),(36,1325705296267184,'Erin Adams, MAMFT, LPC, NCC',NULL,NULL,'Erin is a graduate of Georgia Southern University and Psychological Studies Institute (PSI). PSI specializes in training Christian counselors. She holds a Masters in Marriage and Family Therapy. She is a Licensed Professional Counselor and a National Certified Counselor. A longtime member of the America Association of Christian Counselors, Erin has over 8 years&rsquo; experience in Christian counseling, counseling individuals, couples, families and groups. She has worked with the Department of Family and Children Services as well as with several Georgia community service boards offering her experience working with issues such as depression, anxiety, abuse and adjustment issues, bipolar disorder and women&rsquo;s issues.','barnabuscenter1@gmail.com','https://barnabascenter.net/counselors/',NULL,NULL,NULL,NULL,'783203669844439,1283280447884230,1008711479120012,1256141359404543,882236668593456,1284633846797625,673096547692423','855260068571176','637879152777206',788710545598112,'6.393870977796836e284',NULL),(37,1339182713147731,'Trauma Drama Therapy',NULL,NULL,'Has your child experienced a traumatic event such as physical or sexual abuse, the traumatic death of a loved one, or witnessing domestic violence? Such traumas are treatable when using evidence based Trauma Focused-Cognitive Behavioral Therapy. Research indicates that TF-CBT is the most successful treatment for traumatized children.\nI am a Certified Trauma Focused-Cognitive Behavioral Therapist. I can help your child address thoughts, feelings and behaviors that have been negatively affecting him or her. By adhering to this evidence based process, together we (parent/caretaker, child and therapist) can address trauma reminders and inaccurate or unhelpful beliefs.\nIf your child has experienced a traumatic event and you would like more information, please don\'t hesitate to contact me, Lorrie Rumpel, at Trauma Drama Therapy.','lrumpel@traumadrama.us','https://www.psychologytoday.com/us/therapists/trauma-drama-therapy-savannah-ga/154733',NULL,NULL,NULL,NULL,'1135732068683638,662049722606958,1318373996342348','1225987825999811','680724149779279',588559626701281,'1.2979198662606257e177',NULL);
