9',NULL),(16,575100700886576,'Individual Counseling',NULL,1264690864853116,NULL,'574794009437158','http://www.georgiaoutreach.com/personnel/ashley-richbourg-lcsw/',NULL,'Not vetted','1097885029940814,1240410422818771,884876263410314,1203772244712309,1146502286863512,834661138587154,814367410605790,1174330362614495',NULL,NULL,NULL,NULL,NULL,'1000710924307359',NULL,'848899122442716','639387097779678,1213394553614190,953369181551142,987463381209808,616815450655447','1121486060644435',NULL,NULL),(17,608268734276411,'Obsessive Compulsive Disorder','OCD',830369986737903,'Obsessive-compulsive disorder (OCD) is a mental disorder in which people experience unwanted and repeated thoughts, feelings, images, or sensations (obsessions) and engage in behaviors or mental acts (compulsions) in response. Often a person with OCD carries out the compulsions to temporarily eliminate or reduce the impact of obsessions, and not performing them causes distress. OCD varies in severity, but if left untreated, it can limit one\'s ability to function at work, school, or home. For more information concerning Obsessive Compulsive Disorder, click the following link:\nhttps://www.psychologytoday.com/us/conditions/obsessive-compulsive-disorder','1226239597576850','https://iocdf.org/providers/burnsed-geffen-adelle/',NULL,'Not vetted','1240410422818771,1039361098841116,1203772244712309,1317377462833447,973043712374470',NULL,NULL,NULL,NULL,NULL,'822775222771959',NULL,'1250505501130350','1213394553614190,616815450655447,953369181551142,639387097779678,1193781551435948','1189076306730311',NULL,NULL),(18,623183571206948,'Trauma Assessment',NULL,1271207565206427,'Trauma-informed mental health assessment offers a structured framework for (1) gathering information across several key domains of functioning, (2) identifying and addressing the needs of children and families exposed to traumatic events, and (3) coding and summarizing this information, so that it can be communicated to families and other providers.','572222951228384','https://recoveryplace.org/',NULL,'Not vetted','1003468187388912,751209368821784,1240410422818771,1203772244712309,1002100520878338,1009514155552809,814367410605790,820330329667220,1039361098841116,1095592483926313',NULL,NULL,NULL,NULL,NULL,'891022590186155',NULL,'1329779272841786','639387097779678,771052077935881,968949207637259,689909481504179,618650255730163,890080428886480,910547125138880','1282583230320152','3/20/2019 12:21:50',NULL),(19,620477656631858,'Youth Substance Abuse Assessment',NULL,1188157508639868,NULL,'1046407159111348','https://www.gatewaybhs.org/',NULL,'Not vetted','1003468187388912,1248610812578442,1240410422818771,1002100520878338,878075007783884,1009514155552809,1039361098841116,791691614771819,850189215189288,908213495422625',NULL,NULL,NULL,NULL,NULL,'1055462335344100','1215363497097119',NULL,'639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,988970636517896,1160063855866694,618650255730163,890080428886480,1247220421586706,846883653369076,121339455361','909142759685972','3/20/2019 12:30:30',NULL),(20,629036858950498,'Grief Therapy','Bereavement',857524097390237,'Bereavement is the state of loss when someone close to an individual has died. The death of a loved one is one of the greatest sorrows that can occur in one\'s life. People\'s responses to grief will vary depending upon the circumstances of the death, but grief is a normal, healthy response to loss. Feelings of bereavement can also accompany other losses, such as the decline of one\'s health or the health of a close other, or the end of an important relationship.\nRead more about it: https://www.psychologytoday.com/us/conditions/bereavement','983268101472067','https://barnabascenter.net/counselors/',NULL,'Not vetted','1282080171129447,884876263410314,1240410422818771,1146502286863512,834661138587154,1019218787740671,1203772244712309,814367410605790,820330329667220,1224065867035634',NULL,NULL,NULL,NULL,NULL,'1275228658146727',NULL,