 Counseling',NULL,932661260333112,NULL,'1114721937397983','http://www.yapinc.org/',NULL,'Not vetted','1003468187388912,1289367717251475,995785000610087',NULL,NULL,NULL,NULL,NULL,'1155064651413505',NULL,'1143267406656032','639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,616815450655447','1244119270909154','3/20/2019 14:05:30',NULL),(33,623361355699074,'PTSD','PTSD',876471803286413,'PTSD is a disorder that develops in some people who have experienced a shocking, scary, or dangerous event.\nIt is natural to feel afraid during and after a traumatic situation. Fear triggers many split-second changes in the body to help defend against danger or to avoid it. This fight-or-flight response is a typical reaction meant to protect a person from harm. Nearly everyone will experience a range of reactions after trauma, yet most people recover from initial symptoms naturally. Those who continue to experience problems may be diagnosed with PTSD. People who have PTSD may feel stressed or frightened even when they are not in danger. For more information concerning PTSD, click on the following link:\nhttps://www.psychologytoday.com/us/blog/the-resilient-brain/201903/trauma-and-ptsd-more-common-you-think','918057918783910','https://www.psychologytoday.com/us/therapists/andrea-elam-savannah-ga/139075?p=1',NULL,'Not vetted','1240410422818771,610057797106182,834661138587154,1146502286863512,919448866150716,790497382892263,831552675651517,633127587151884,820330329667220,666142468264925,756352161259882',NULL,NULL,NULL,NULL,NULL,'1157110391844305',NULL,'746221124185236','639387097779678,1213394553614190,821622375158469,616815450655447,953369181551142,774801223398951,574787015241078','1201660463997205',NULL,NULL),(34,638816317331342,'Youth Developmental Disabilities Services ',NULL,1241524558231705,NULL,'1276050815212765','www.cwilliamsandassociates.com',NULL,'Not vetted','1240410422818771,1203772244712309,610057797106182,607830862982748,834661138587154,1146502