adrama.us','Vetting In Progress','1003468187388912,751209368821784,790497382892263,1039361098841116',NULL,NULL,NULL,NULL,NULL,'1225987825999811',NULL,'588559626701281','639387097779678,1297919866260619,789421862693567,771052077935881,988970636517896,675333962875133,915499537874128,944379166032449,818831669488442,616815450655447,953369181551142,12133945536141','799761410070077','3/20/2019 13:48:05',NULL),(55,639080353826117,'PTSD',NULL,1306784019365289,'PTSD is a disorder that develops in some people who have experienced a shocking, scary, or dangerous event.\nIt is natural to feel afraid during and after a traumatic situation. Fear triggers many split-second changes in the body to help defend against danger or to avoid it. This fight-or-flight response is a typical reaction meant to protect a person from harm. Nearly everyone will experience a range of reactions after trauma, yet most people recover from initial symptoms naturally. Those who continue to experience problems may be diagnosed with PTSD. People who have PTSD may feel stressed or frightened even when they are not in danger. For more information concerning PTSD, click on the following link:\nhttps://www.psychologytoday.com/us/blog/the-resilient-brain/201903/trauma-and-ptsd-more-common-you-think','766114163250573','http://www.georgiaoutreach.com/therapists-3/judy-saucerman-lcsw/',NULL,'Not vetted','884876263410314,1240410422818771,1203772244712309,554388805123029,1146502286863512,834661138587154,974194458320592,799387826971055,814367410605790,633127587151884,666142468264925,108981230896',NULL,NULL,NULL,NULL,NULL,'946390674647798',NULL,'1021481825385959','639387097779678,1213394553614190','1121486060644435',NULL,NULL),(56,641389373878279,'Sexual Issues',NULL,732833359260751,NULL,'1052979040721473','http://gahealthpartners.com/',NULL,'Not vetted','1240410422818771,1203772244712309,589472247873238,834661138587154,1146502286863512,1174330362614495,554388805123029,884876263410314,1095552548215797,84078951277377