nue to experience problems may be diagnosed with PTSD. People who have PTSD may feel stressed or frightened even when they are not in danger. For more information concerning PTSD, click on the following link:\nhttps://www.psychologytoday.com/us/blog/the-resilient-brain/201903/trauma-and-ptsd-more-common-you-think','827392117018258','https://www.statesboropsych.com/contact-us/',NULL,'Not vetted','927196575193538,1009514155552809,770867467503452,834661138587154,1146502286863512,666142468264925,1087821211043828,633127587151884,974194458320592,1226867632374211',NULL,NULL,NULL,NULL,NULL,'911949867147692',NULL,'1162485668871511','639387097779678,1213394553614190,616815450655447,953369181551142,1160063855866694,618650255730163,890080428886480,1254253296739887,636015951022686','1129664860333409',NULL,NULL),(65,769147041617785,'Teen Issues',NULL,732833359260751,NULL,'1052979040721473','http://gahealthpartners.com/',NULL,'Not vetted','1240410422818771,1203772244712309,589472247873238,834661138587154,1146502286863512,1174330362614495,554388805123029,884876263410314,1095552548215797,840789512773778,1191545197302694,634390495',NULL,NULL,NULL,NULL,NULL,'1005138863537264',NULL,NULL,'1095053765654102,639387097779678,789421862693567,988970636517896,1193781551435948,1149777292769951,1160063855866694,618650255730163,1207857486716732,573698134502315,890080428886480,1247220421','1152570902873872','3/6/2019 16:09:43',NULL),(66,772967945034549,'Cognitive Behavioral Therapy','CGT',1271207565206427,'Cognitive Behavioral therapy is an action-oriented form of psychosocial therapy that assumes that maladaptive, or faulty, thinking patterns cause maladaptive behavior and \"negative\" emotions. (Maladaptive behavior is behavior that is counter-productive or interferes with everyday living.) The treatment focuses on changing an individual\'s thoughts (cognitive patterns) in order to change his or her behavior and emotional state.\nFor more information, click on the following link:\nhttps://www.psychologytoday.com/us/basics/cognitive-behavioral-therapy','572222951228384','https://recoveryplace.org/',NULL,'Not vetted','1003468187388912,751209368821784,1240410422818771,1203772244712309,1002100520878338,1009514155552809,814367410605790,820330329667220,1039361098841116,1095592483926313',NULL,NULL,NULL,NULL,NULL,'891022590186155',NULL,'1329779272841786','639387097779678,771052077935881,968949207637259,689909481504179,618650255730163,890080428886480,910547125138880','1282583230320152','3/20/2019 12:21:50',NULL),(67,720596635868327,'Community Support',NULL,957645980497354,NULL,'785753978316869','https://barnabascenter.net/',NULL,'Not vetted','1282080171129447,1003468187388912,1240410422818771,1203772244712309,1002100520878338,1289367717251475,1174330362614495,1019218787740671,554388805123029,918858089518250,1146502286863512,834661',NULL,NULL,NULL,NULL,NULL,'1275228658146727',NULL,NULL,NULL,'1315949018963376',NULL,NULL),(68,746725697673984,'Depression',NULL,1066842143635008,'Depression is a mood disorder that causes a persistent feeling of sadness and loss of interest. Also called major depressive disorder or clinical depression, it affects how you feel, think and behave and can lead to a variety of emotional and physical problems. For more information, click the following link:\nhttps://www.psychologytoday.com/us/basics/depression','624872025396095','http://www.joyepsychology.com/',NULL,'Not vetted','1003468187388912,751209368821784,1240410422818771,1203772244712309,790497382892263,953681738140219,834661138587154,1146502286863512,1039361098841116,666142468264925,1317377462833447',NULL,NULL,NULL,NULL,NULL,'909316241133034',NULL,NULL,'639387097779678,1160063855866694,1243892237514253,1320420504969618,636015951022686,1160854949421677,1175779353594655,1213394553614190','629797810057384','3/20/2019 13:19:13',NULL),(69,778451438763707,'Dialectical Behavior Therapy','DBT',888435226473868,'Dialectical behavior therapy (DBT) provides clients with new skills to manage painful emotions and decrease conflict in relationships. DBT specifically focuses on providing therapeutic skills in four key areas. First, mindfulness focuses on improving an individual\'s ability to accept and be present in the current moment. Second, distress tolerance is geared toward increasing a persons tolerance of negative emotion, rather than trying to escape from it. Third, emotion regulation covers strategies to manage and change intense emotions that are causing problems in a persons life. Fourth, interpersonal effectiveness consists of techniques that allow a person to communicate with others in a way that is assertive, maintains self-respect, and strengthens relationships. To read more about Dialectical Behavioral Therapy (DBT), click on the following link:\nhttps://www.psychologytoday.com/us/therapy-types/dialectical-behavior-therapy','1197180011238880','www.mgacommunityservices.com',NULL,'Not vetted','1003468187388912,751209368821784,1240410422818771,1203772244712309,1002100520878338,1289367717251475,1009514155552809,748835921605420,1039361098841116,791691614771819,793274560277759,85832866',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'882026281098116','639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,988970636517896,1193781551435948,618650255730163,915499537874128,616815450655447,953369181551142,1213394553614','1276442726248600','3/20/2019 12:09:27',NULL),(70,786790323113279,'Individual Counseling',NULL,1066842143635008,NULL,'624872025396095','http://www.joyepsychology.com/',NULL,'Not vetted','1003468187388912,751209368821784,1240410422818771,1203772244712309,790497382892263,953681738140219,834661138587154,1146502286863512,1039361098841116,666142468264925,1317377462833447',NULL,NULL,NULL,NULL,NULL,'909316241133034',NULL,NULL,'639387097779678,1160063855866694,1243892237514253,1320420504969618,636015951022686,1160854949421677,1175779353594655,1213394553614190','629797810057384','3/20/2019 13:19:13',NULL),(71,785676709310814,'Individual