63512,834661',NULL,NULL,NULL,NULL,NULL,'1275228658146727',NULL,NULL,NULL,'1315949018963376',NULL,NULL),(78,786963155137345,'Community Support',NULL,732833359260751,NULL,'1052979040721473','http://gahealthpartners.com/',NULL,'Not vetted','1240410422818771,1203772244712309,589472247873238,834661138587154,1146502286863512,1174330362614495,554388805123029,884876263410314,1095552548215797,840789512773778,1191545197302694,634390495',NULL,NULL,NULL,NULL,NULL,'1005138863537264',NULL,NULL,'1095053765654102,639387097779678,789421862693567,988970636517896,1193781551435948,1149777292769951,1160063855866694,618650255730163,1207857486716732,573698134502315,890080428886480,1247220421','1152570902873872','3/6/2019 16:09:43',NULL),(79,791600627648672,'Dialectical Behavioral Therapy','DBT',732833359260751,'Dialectical behavior therapy (DBT) provides clients with new skills to manage painful emotions and decrease conflict in relationships. DBT specifically focuses on providing therapeutic skills in four key areas. First, mindfulness focuses on improving an individual\'s ability to accept and be present in the current moment. Second, distress tolerance is geared toward increasing a persons tolerance of negative emotion, rather than trying to escape from it. Third, emotion regulation covers strategies to manage and change intense emotions that are causing problems in a persons life. Fourth, interpersonal effectiveness consists of techniques that allow a person to communicate with others in a way that is assertive, maintains self-respect, and strengthens relationships. To read more about Dialectical Behavioral Therapy (DBT), click on the following link:\nhttps://www.psychologytoday.com/us/therapy-types/dialectical-behavior-therapy','1052979040721473','http://gahealthpartners.com/',NULL,'Not vetted','1240410422818771,1203772244712309,589472247873238,834661138587154,1146502286863512,1174330362614495,554388805123029,884876263410314,1095552548215797,840789512773778,1191545197302694,634390495',NULL,NULL,NULL,NULL,NULL,'1005138863537264',NULL,NULL,'1095053765654102,639387097779678,789421862693567,988970636517896,1193781551435948,1149777292769951,1160063855866694,618650255730163,1207857486716732,573698134502315,890080428886480,1247220421','1152570902873872','3/6/2019 16:09:43',NULL),(80,792670772461033,'Cognitive Behavioral Therapy','CBT',567977363172359,'Cognitive Behavioral therapy is an action-oriented form of psychosocial therapy that assumes that maladaptive, or faulty, thinking patterns cause maladaptive behavior and \"negative\" emotions. (Maladaptive behavior is behavior that is counter-productive or interferes with everyday living.) The treatment focuses on changing an individual\'s thoughts (cognitive patterns) in order to change his or her behavior and emotional state.\nFor more information, click on the following link:\nhttps://www.psychologytoday.com/us/basics/cognitive-behavioral-therapy','958018420884621','https://npino.com/behavioral-health/1467990119-introspection-&-reflection/',NULL,'Not vetted','751209368821784,1240410422818771,1203772244712309,790497382892263,748835921605420,814367410605790,820330329667220,589472247873238,834661138587154,1039361098841116,655863929386813,117433036261',NULL,NULL,NULL,NULL,NULL,'785541576275303','1239940828837483,1185806972759577','1263119709592773','639387097779678,789421862693567,771052077935881,968949207637259,988970636517896,618650255730163,890080428886480,1321861983203612,616815450655447,953369181551142,1213394553614190','783064209583387','3/12/2019 14:34:33',NULL),(81,757062004010689,'Nursing Services',NULL,1188157508639868,NULL,'1046407159111348','www.gatewaybhs.org',NULL,'Not vetted','1003468187388912,1248610812578442,1240410422818771,1002100520878338,878075007783884,1009514155552809,1039361098841116,791691614771819,850189215189288,908213495422625',NULL,NULL,NULL,NULL,NULL,'1055462335344100','1215363497097119',NULL,'639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,9