are normal, some people have difficulty moving on with their lives. Psychologists can help these individuals find constructive ways of managing their emotions.\nFor more information about trauma , please click the following link:\nhttps://www.apa.org/topics/trauma/','991433071763078','http://hopecounseling.center/',NULL,'Not vetted','1240410422818771,1203772244712309,1224065867035634,979551410768146,1145089114996156,790497382892263,820330329667220,919448866150716,1106581118915979,1174330362614495,554388805123029,123043153',NULL,NULL,NULL,NULL,NULL,'584003418223973',NULL,'1045777867810878','639387097779678,771052077935881,968949207637259,988970636517896,689909481504179,1149777292769951,1160063855866694,618650255730163,890080428886480,1243892237514253,578290825124982,785935366286','1009042032512685','3/12/2019 14:23:58',NULL),(95,801413377026488,'Mood Disorder',NULL,1094401029893949,'Mood disorder is defined by the DSM (diagnostic statistical manual) as: a psychiatric disorder in which the principal feature is mood disturbance. Mood disorders include the depressive disorders (e.g., MAJOR DEPRESSIVE DISORDER, DYSTHYMIC DISORDER), the BIPOLAR DISORDERS, MOOD DISORDERS DUE TO A GENERAL MEDICAL CONDITION, SUBSTANCE-INDUCED mood disorder, and not otherwise specified, which does not meet the diagnostic criteria for any of the specific mood disorders. Mood disorders can affect both females and males equally- they typically become noticeable after life events shock an individual into mood or depressive disorders. For more information, click the following link: https://www.mayoclinic.org/diseases-conditions/mood-disorders/symptoms-causes/syc-20365057\n','649379739448609','https://www.myviewpointhealth.org/about/programs-a-to-z/','susan.gattman@vphealth.org','Vetting In Progress',NULL,NULL,NULL,NULL,NULL,NULL,'1040192431403484',NULL,'1095457030682112','639387097779678,915499537874128,616815450655447,953369181551142,1213394553614190,1022757596728517,1242514362876733,111892383883