rvices/behavioral-health-care-services/',NULL,'Not vetted','1003468187388912,1289367717251475,995785000610087',NULL,NULL,NULL,NULL,NULL,'1199373240119152',NULL,'1143267406656032',NULL,NULL,'3/20/2019 14:05:30',NULL),(125,850960199917195,'Core Services- Child and Adolescent','Core Services',732833359260751,'Child & Adolescent Services are basic outpatient services for youth under the age of 18 years old in need of Mental Health or Addictive Disease services. Youth aged 18-21 years (children still in high school or when it is otherwise developmentally/ clinically indicated) may be served to assist with transitioning to adult services. Services consist of evaluations by both a psychiatrist and a nurse; the development of a treatment plan, which may include prescription medication; a schedule of appointments for outpatient counseling and home visits by a community support worker.','1052979040721473','http://gahealthpartners.com/',NULL,'Not vetted','1240410422818771,1203772244712309,589472247873238,834661138587154,1146502286863512,1174330362614495,554388805123029,884876263410314,1095552548215797,840789512773778,1191545197302694,634390495',NULL,NULL,NULL,NULL,NULL,'1005138863537264',NULL,NULL,'1095053765654102,639387097779678,789421862693567,988970636517896,1193781551435948,1149777292769951,1160063855866694,618650255730163,1207857486716732,573698134502315,890080428886480,1247220421','1152570902873872','3/6/2019 16:09:43',NULL),(126,857548956708557,'Youth LGBTQ+ Issues',NULL,1241524558231705,'https://www.psychologytoday.com/us/blog/quite-queerly/201706/pride-in-mental-health-crisis-intervention','1276050815212765','www.cwilliamsandassociates.com',NULL,'Not vetted','1240410422818771,1203772244712309,610057797106182,607830862982748,834661138587154,1146502286863512,1174330362614495,554388805123029,1095552548215797,770867467503452,840789512773778,1262490839',NULL,NULL,NULL,NULL,NULL,'1122969038292767',NULL,'1246039041277873','639387097779678,789421862693567,771052077935881,968