ollowing link:\nhttps://www.psychologytoday.com/us/basics/cognitive-behavioral-therapy','624872025396095','http://www.joyepsychology.com/',NULL,'Not vetted','1003468187388912,751209368821784,1240410422818771,1203772244712309,790497382892263,953681738140219,834661138587154,1146502286863512,1039361098841116,666142468264925,1317377462833447',NULL,NULL,NULL,NULL,NULL,'909316241133034',NULL,NULL,'639387097779678,1160063855866694,1243892237514253,1320420504969618,636015951022686,1160854949421677,1175779353594655,1213394553614190','629797810057384','3/20/2019 13:19:13',NULL),(130,812561181026544,'Family Counseling',NULL,857524097390237,NULL,'983268101472067','https://barnabascenter.net/counselors/',NULL,'Not vetted','1282080171129447,884876263410314,1240410422818771,1146502286863512,834661138587154,1019218787740671,1203772244712309,814367410605790,820330329667220,1224065867035634',NULL,NULL,NULL,NULL,NULL,'1275228658146727',NULL,'975971103048489','639387097779678,1213394553614190,616815450655447,953369181551142,675333962875133,1193781551435948,987463381209808,818831669488442,890080428886480,1224288192870809,1160063855866694,94597836827','1262420945163898',NULL,NULL),(131,844974435726986,'Mood Disorders',NULL,1306784019365289,'Mood disorder is defined by the DSM (diagnostic statistical manual) as: a psychiatric disorder in which the principal feature is mood disturbance. Mood disorders include the depressive disorders (e.g., MAJOR DEPRESSIVE DISORDER, DYSTHYMIC DISORDER), the BIPOLAR DISORDERS, MOOD DISORDERS DUE TO A GENERAL MEDICAL CONDITION, SUBSTANCE-INDUCED mood disorder, and not otherwise specified, which does not meet the diagnostic criteria for any of the specific mood disorders. Mood disorders can affect both females and males equally- they typically become noticeable after life events shock an individual into mood or depressive disorders. For more information, click the following link: https://www.mayoclinic.org/diseases-conditions/mood-disorders/symptoms-causes/syc-20365057','766114163250573','http://www.georgiaoutreach.com/therapists-3/judy-saucerman-lcsw/',NULL,'Not vetted','884876263410314,1240410422818771,1203772244712309,554388805123029,1146502286863512,834661138587154,974194458320592,799387826971055,814367410605790,633127587151884,666142468264925,108981230896',NULL,NULL,NULL,NULL,NULL,'946390674647798',NULL,'1021481825385959','639387097779678,1213394553614190','1121486060644435',NULL,NULL),(132,842619939184791,'Youth Pet Therapy',NULL,887938623409132,NULL,'991433071763078','http://hopecounseling.center/',NULL,'Not vetted','1240410422818771,1203772244712309,1224065867035634,979551410768146,1145089114996156,790497382892263,820330329667220,919448866150716,1106581118915979,1174330362614495,554388805123029,123043153',NULL,NULL,NULL,NULL,NULL,'584003418223973',NULL,'1045777867810878','639387097779678,771052077935881,968949207637259,988970636517896,689909481504179,1149777292769951,1160063855866694,618650255730163,890080428886480,1243892237514253,578290825124982,785935366286','1009042032512685','3/12/2019 14:23:58',NULL),(133,852406902300408,'PTSD',NULL,1094401029893949,'PTSD is a disorder that develops in some people who have experienced a shocking, scary, or dangerous event.\nIt is natural to feel afraid during and after a traumatic situation. Fear triggers many split-second changes in the body to help defend against danger or to avoid it. This fight-or-flight response is a typical reaction meant to protect a person from harm. Nearly everyone will experience a range of reactions after trauma, yet most people recover from initial symptoms naturally. Those who continue to experience problems may be diagnosed with PTSD. People who have PTSD may feel stressed or frightened even when they are not in danger. For more information concerning PTSD, click on the following link:\nhttps://www.psychologytoday.com/us/blog/the-resilient-brain/201903/trauma-and-ptsd-more-common-you-think\n','649379739448609','https://www.myviewpointhealth.org/about/programs-a-to-z/','susan.gattman@vphealth.org','Vetting In Progress',NULL,NULL,NULL,NULL,NULL,NULL,'1040192431403484',NULL,'1095457030682112','639387097779678,915499537874128,616815450655447,953369181551142,1213394553614190,1022757596728517,1242514362876733,1118923838832231,856368601852487,748116754740747,593506918155739,63918492060',NULL,NULL,NULL),(134,873705694105417,'Youth Autism Services',NULL,1258030347645238,NULL,'712300758206965','https://www.facebook.com/qandrconsultationservicesllc/',NULL,'Not vetted','1240410422818771,1203772244712309,756352161259882,1174330362614495,554388805123029,884876263410314,840789512773778,779626884775672,770305239417855,1191545197302694,1178423577607421,1097885029','Autism, as defined by Individuals with Disabilities Education Act (IDEA), refers to a developmental disability significantly affecting verbal and nonverbal communication and social interaction, generally evident before age three, that adversely affects a childs educational performance. Read more about autism:\nhttps://www.specialeducationguide.com/disability-profiles/autism/',NULL,NULL,NULL,NULL,'1280430268019655','1239940828837483','1291078742541334','639387097779678,771052077935881,968949207637259,689909481504179,618650255730163,890080428886480,910547125138880,616815450655447,1213394553614190,821622375158469,1197045062186443,1297919866260','1260350870291637','3/12/2019 15:05:08',NULL),(135,817453176806210,'Behavioral Consulation',NULL,1188157508639868,NULL,'1046407159111348','https://www.gatewaybhs.org/',NULL,'Not vetted','1003468187388912,1248610812578442,1240410422818771,1002100520878338,878075007783884,1009514155552809,1039361098841116,791691614771819,850189215189288,908213495422625',NULL,NULL,NULL,NULL,NULL,'1055462335344100','1215363497097119',NULL,'639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,988970636517896,1160063855866694,618650255730163,890080428886480,1247220421586706,846883653369076,121339455361','90914275968