wing the therapist to observe the childs choices, decisions, and play style. The goal is to help children learn to express themselves in healthier ways, become more respectful and empathetic, and discover new and more positive ways to solve problems.\nRead more about therapy by clicking the following link:\nhttps://www.psychologytoday.com/us/blog/contemporary-psychoanalysis-in-action/201601/child-s-play-how-play-therapy-works\n','983268101472067','https://barnabascenter.net/counselors/',NULL,'Not vetted','1282080171129447,884876263410314,1240410422818771,1146502286863512,834661138587154,1019218787740671,1203772244712309,814367410605790,820330329667220,1224065867035634',NULL,NULL,NULL,NULL,NULL,'1275228658146727',NULL,'975971103048489','639387097779678,1213394553614190,616815450655447,953369181551142,675333962875133,1193781551435948,987463381209808,818831669488442,890080428886480,1224288192870809,1160063855866694,94597836827','1262420945163898',NULL,NULL),(140,883427021420284,'Sex Offender Group Counseling',NULL,1209156844866073,NULL,'958018420884621','http://southeastsecondchance.org/',NULL,'Not vetted','751209368821784,1240410422818771,1203772244712309,790497382892263,748835921605420,814367410605790,820330329667220,589472247873238,834661138587154,1039361098841116,655863929386813,117433036261',NULL,NULL,NULL,NULL,NULL,'785541576275303','1239940828837483,1185806972759577','1263119709592773','639387097779678,789421862693567,771052077935881,968949207637259,988970636517896,618650255730163,890080428886480,1321861983203612,616815450655447,953369181551142,1213394553614190','783064209583387','3/12/2019 14:34:33',NULL),(141,852793073863382,'Intensive Family Therapy',NULL,888435226473868,NULL,'1197180011238880','www.mgacommunityservices.com',NULL,'Not vetted','1003468187388912,751209368821784,1240410422818771,1203772244712309,1002100520878338,1289367717251475,1009514155552809,748835921605420,1039361098841116,791691614771819,793274560277759,85832866',NULL,NULL,NULL,NULL,NULL,N