25,756352161259882',NULL,NULL,NULL,NULL,NULL,'1157110391844305',NULL,'746221124185236','639387097779678,1213394553614190,821622375158469,616815450655447,953369181551142,774801223398951,574787015241078','1201660463997205',NULL,NULL),(162,898434683684765,'Clubhouse Psychiatric Rehabilitation Services',NULL,1112271443337891,NULL,'754649737705617','www.gatewaybhs.org',NULL,'Not vetted','1240410422818771,1203772244712309,877056620750945,1009514155552809,1174330362614495,1230431537610570,884876263410314,770867467503452,1172570269569144,1076768128765048,1191545197302694,6343904',NULL,NULL,NULL,NULL,NULL,'854685172508860','1114986783482614,1239940828837483,1185806972759577','959714851720583','639387097779678,791587286497701,578514860857586,1297919866260619,771052077935881,968949207637259,618650255730163,915499537874128,616815450655447,1213394553614190','834050775421568','3/6/2019 15:38:51',NULL),(163,908697606879147,'Offender Treatment',NULL,599571630068226,NULL,'1052979040721473','https://www.georgiaoutreach.com/',NULL,'Not vetted','1002100520878338,756352161259882,790497382892263,748835921605420,1039361098841116,850189215189288,1168988306202557,1174330362614495,554388805123029,973043712374470,884876263410314,13092466784',NULL,NULL,NULL,NULL,NULL,'1223764135647595',NULL,'860772927661742','639387097779678,789421862693567,988970636517896,1193781551435948,1149777292769951,1160063855866694,618650255730163,1207857486716732,573698134502315,890080428886480,1247220421586706,6168154506','1152570902873872','3/12/2019 14:04:30',NULL),(164,916086599181705,'PTSD',NULL,1241524558231705,'PTSD is a disorder that develops in some people who have experienced a shocking, scary, or dangerous event.\nIt is natural to feel afraid during and after a traumatic situation. Fear triggers many split-second changes in the body to help defend against danger or to avoid it. This fight-or-flight response is a typical reaction meant to protect a person from harm. Nearly everyone will experience a range of reactions after trauma, yet most people recover from initial symptoms naturally. Those who continue to experience problems may be diagnosed with PTSD. People who have PTSD may feel stressed or frightened even when they are not in danger. For more information concerning PTSD, click on the following link:\nhttps://www.psychologytoday.com/us/blog/the-resilient-brain/201903/trauma-and-ptsd-more-common-you-think','1276050815212765','www.cwilliamsandassociates.com',NULL,'Not vetted','1240410422818771,1203772244712309,610057797106182,607830862982748,834661138587154,1146502286863512,1174330362614495,554388805123029,1095552548215797,770867467503452,840789512773778,1262490839',NULL,NULL,NULL,NULL,NULL,'1122969038292767',NULL,'1246039041277873','639387097779678,789421862693567,771052077935881,968949207637259,988970636517896,1330329970990630,689909481504179,1193781551435948,1160063855866694,797229853250820,616815450655447,121339455361','772724587330531','3/6/2019 16:01:45',NULL),(165,944937577356564,'Anxiety',NULL,1306784019365289,'Anxiety is a chronic condition characterized by an excessive and persistent sense of apprehension, with physical symptoms such as sweating, palpitations, and feelings of stress. For more information, click the following link:\nhttps://www.psychologytoday.com/us/conditions/generalized-anxiety-disorder','766114163250573','http://www.georgiaoutreach.com/therapists-3/judy-saucerman-lcsw/',NULL,'Not vetted','884876263410314,1240410422818771,1203772244712309,554388805123029,1146502286863512,834661138587154,974194458320592,799387826971055,814367410605790,633127587151884,666142468264925,108981230896',NULL,NULL,NULL,NULL,NULL,'946390674647798',NULL,'1021481825385959','639387097779678,1213394553614190','1121486060644435',NULL,NULL),(166,952539516865852,'Crisis Intervention',NULL,732833359260751,'Mental health crisis intervention refers to methods that offer immediate, short-term help to individuals who are experiencing an event that is producing emotional, mental, physical, and behavioral distress or problems. Mental health crises are usually temporary, short-lived, and last no longer than one month. To read more about crisis in Mental Health, click on the following link:\nhttps://www.nami.org/Find-Support/Living-with-a-Mental-Health-Condition/What-to-Do-In-a-Crisis','1052979040721473','http://gahealthpartners.com/',NULL,'Not vetted','1240410422818771,1203772244712309,589472247873238,834661138587154,1146502286863512,1174330362614495,554388805123029,884876263410314,1095552548215797,840789512773778,1191545197302694,634390495',NULL,NULL,NULL,NULL,NULL,'1005138863537264',NULL,NULL,'1095053765654102,639387097779678,789421862693567,988970636517896,1193781551435948,1149777292769951,1160063855866694,618650255730163,1207857486716732,573698134502315,890080428886480,1247220421','1152570902873872','3/6/2019 16:09:43',NULL),(167,952153730113257,'Trauma Assessment',NULL,1188157508639868,'Trauma-informed mental health assessment offers a structured framework for (1) gathering information across several key domains of functioning, (2) identifying and addressing the needs of children and families exposed to traumatic events, and (3) coding and summarizing this information, so that it can be communicated to families and other providers.','1046407159111348','https://www.gatewaybhs.org/',NULL,'Not vetted','1003468187388912,1248610812578442,1240410422818771,1002100520878338,878075007783884,1009514155552809,1039361098841116,791691614771819,850189215189288,908213495422625',NULL,NULL,NULL,NULL,NULL,'1055462335344100','1215363497097119',NULL,'639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,988970636517896,1160063855866694,618650255730163,890080428886480,1247220421586706,846883653369076,121339455361','909142759685972','3/20/2019 12:30:30',NULL),(168,911017547667235,'Depression',NULL,908935519698397,'Depression is a mood disorder that causes a persistent feeling of sadness and loss of interest. Also called major depressive disorder or clinical depression, it affects how you feel, think and behave and can lead to a variety of emotional and physical problems. For more information, click the following link:\nhttps://www.psychologytoday.com/us/basics/depression','827392117018258','https://www.statesboropsych.com/contact-us/',NULL,'Not vetted','927196575193538,1009514155552809,770867467503452,834661138587154,1146502286863512,666142468264925,1087821211043828,633127587151884,974194458320592,1226867632374211',NULL,NULL,NULL,NULL,NULL,'911949867147692',NULL,'1162485668871511','639387097779678,1213394553614190,616815450655447,953369181551142,1160063855866694,618650255730163,890080428886480,1254253296739887,636015951022686','1129664860333409',NULL,NULL),(169,910998195780879,'Mood Disorders','Bipolar',1241524558231705,'Mood disorder is defined by the DSM (diagnostic statistical manual) as: a psychiatric disorder in which the principal feature is mood disturbance. Mood disorders include the depressive disorders (e.g., MAJOR DEPRESSIVE DISORDER, DYSTHYMIC DISORDER), the BIPOLAR DISORDERS, MOOD DISORDERS DUE TO A GENERAL MEDICAL CONDITION, SUBSTANCE-INDUCED mood disorder, and not otherwise specified, which does not meet the diagnostic criteria for any of the specific mood disorders. Mood disorders can affect both females and males equally- they typically become noticeable after life events shock an individual into mood or depressive disorders. For more information, click the following link: https://www.mayoclinic.org/diseases-conditions/mood-disorders/symptoms-causes/syc-20365057','1276050815212765','www.cwilliamsandassociates.com',NULL,'Not vetted','1240410422818771,1203772244712309,610057797106182,607830862982748,834661138587154,1146502286863512,1174330362614495,554388805123029,1095552548215797,770867467503452,840789512773778,1262490839',NULL,NULL,NULL,NULL,NULL,'1122969038292767',NULL,'1246039041277873','639387097779678,789421862693567,771052077935881,968949207637259,988970636517896,1330329970990630,689909481504179,1193781551435948,1160063855866694,797229853250820,616815450655447,121339455361','772724587330531','3/6/2019 16:01:45',NULL),(170,925807144511715,'Self-Esteem',NULL,903011084269923,'Self-esteem is the way individuals think and feel about themselves and how well they do things that are important to them. In children, self-esteem is shaped by what they think and feel about themselves. Their self-esteem is highest when they see themselves as approximating their \"ideal\" self, the person they would like to be. Children who have high self-esteem have an easier time handling conflicts, resisting negative pressures, and making friends. They laugh and smile more and have a generally optimistic view of the world and their life. \n\nRead more: http://www.healthofchildren.com/S/Self-Esteem.html#ixzz5knKme1Bz','987312017916323','https://www.psychologytoday.com/us/therapists/melanie-mills-savannah-ga/95453',NULL,'Not vetted','1240410422818771,1002100520878338,790497382892263,633127587151884,1146502286863512,607830862982748,1039361098841116,973043712374470,589472247873238,666142468264925,974194458320592,82033032966',NULL,NULL,NULL,NULL,NULL,'1223963668955517',NULL,'661564729925858','639387097779678,616815450655447,953369181551142,1213394553614190,1160063855866694,573698134502315,890080428886480,1247220421586706,1224288192870809,1243892237514253,675333962875133,6164868243','919840987033296',NULL,NULL),(171,950703310225408,'Supported employment',NULL,1188157508639868,'Supported Employment emphasizes that rapid job search and placement should be prioritized above traditional prevocational training or traditional vocational rehabilitation. Job development, placement and training assist people who, due to the severity of their disabilities, need support to locate, choose, obtain, learn and maintain a job. Services include supports to choose and obtain paid employment at competitive wages, individually-based community jobs, and brief training to learn the specific skills necessary to perform and retain a particular job. \n \n ','1046407159111348','https://www.gatewaybhs.org/',NULL,'Not vetted','1003468187388912,1248610812578442,1240410422818771,1002100520878338,878075007783884,1009514155552809,1039361098841116,791691614771819,850189215189288,908213495422625',NULL,NULL,NULL,NULL,NULL,'1055462335344100','1215363497097119',NULL,'639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,988970636517896,1160063855866694,618650255730163,890080428886480,1247220421586706,846883653369076,121339455361','909142759685972','3/20/2019 12:30:30',NULL),(172,954442888323940,'Teen Issues',NULL,1258030347645238,NULL,'712300758206965','https://www.facebook.com/qandrconsultationservicesllc/',NULL,'Not vetted','1240410422818771,1203772244712309,756352161259882,1174330362614495,554388805123029,884876263410314,840789512773778,779626884775672,770305239417855,1191545197302694,1178423577607421,1097885029',NULL,NULL,NULL,NULL,NULL,'1280430268019655','1239940828837483','1291078742541334','639387097779678,771052077935881,968949207637259,689909481504179,618650255730163,890080428886480,910547125138880,616815450655447,1213394553614190,821622375158469,1197045062186443,1297919866260','1260350870291637','3/12/2019 15:05:08',NULL),(173,957370874499589,'Intensive Family Counseling',NULL,970550221345922,NULL,'606446291511615','https://www.epact-inc.com/',NULL,'Not vetted','1003468187388912,1282080171129447',NULL,NULL,NULL,NULL,NULL,'1262607973454058',NULL,NULL,'1242514362876733','1073492717210337',NULL,NULL),(174,969029535713516,'Dialectical Behavior therapy','DBT',1188157508639868,'Dialectical behavior therapy (DBT) provides clients with new skills to manage painful emotions and decrease conflict in relationships. DBT specifically focuses on providing therapeutic skills in four key areas. First, mindfulness focuses on improving an individual\'s ability to accept and be present in the current moment. Second, distress tolerance is geared toward increasing a persons tolerance of negative emotion, rather than trying to escape from it. Third, emotion regulation covers strategies to manage and change intense emotions that are causing problems in a persons life. Fourth, interpersonal effectiveness consists of techniques that allow a person to communicate with others in a way that is assertive, maintains self-respect, and strengthens relationships. To read more about Dialectical Behavioral Therapy (DBT), click on the following link:\nhttps://www.psychologytoday.com/us/therapy-types/dialectical-behavior-therapy','1046407159111348','https://www.gatewaybhs.org/',NULL,'Not vetted','1003468187388912,1248610812578442,1240410422818771,1002100520878338,878075007783884,1009514155552809,1039361098841116,791691614771819,850189215189288,908213495422625',NULL,NULL,NULL,NULL,NULL,'1055462335344100','1215363497097119',NULL,'639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,988970636517896,1160063855866694,618650255730163,890080428886480,1247220421586706,846883653369076,121339455361','909142759685972','3/20/2019 12:30:30',NULL),(175,972810163775136,'Parenting Skills',NULL,599571630068226,NULL,'982008775481883','https://www.georgiaoutreach.com/',NULL,'Not vetted','1002100520878338,756352161259882,790497382892263,748835921605420,1039361098841116,850189215189288,1168988306202557,1174330362614495,554388805123029,973043712374470,884876263410314,13092466784',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'918966978329633',NULL,NULL),(176,912619755040973,'Family Counseling',NULL,567977363172359,NULL,'958018420884621','https://npino.com/behavioral-health/1467990119-introspection-&-reflection/',NULL,'Not vetted','751209368821784,1240410422818771,1203772244712309,790497382892263,748835921605420,814367410605790,820330329667220,589472247873238,834661138587154,1039361098841116,655863929386813,117433036261',NULL,NULL,NULL,NULL,NULL,'785541576275303','1239940828837483,1185806972759577','126311970959277