y-impulsivity that interferes with functioning or development.','785753978316869','https://barnabascenter.net/',NULL,'Not vetted','1282080171129447,1003468187388912,1240410422818771,1203772244712309,1002100520878338,1289367717251475,1174330362614495,1019218787740671,554388805123029,918858089518250,1146502286863512,834661',NULL,NULL,NULL,NULL,NULL,'1275228658146727',NULL,NULL,NULL,'1315949018963376',NULL,NULL),(201,950898296416929,'Anger Management',NULL,999476238928145,'Therapeutic interventions that help an individual identify and manage the expression of anger- making the expression appropriate and respectful to others. ','1179109764528412','http://www.headsupsavannah.org/',NULL,'Not vetted','1240410422818771,1002100520878338,756352161259882,814367410605790,1039361098841116,1168988306202557,1174330362614495,554388805123029,973043712374470,1230431537610570,884876263410314,768650658',NULL,NULL,NULL,NULL,NULL,'1287198807341402',NULL,'860772927661742','639387097779678,821622375158469,747224856139696,616815450655447,1213394553614190,989871016592197','924957010351440','3/12/2019 14:11:48',NULL),(202,954091525511900,'Dialectical Behavior Therapy','DBT',763326334047675,'Dialectical behavior therapy (DBT) provides clients with new skills to manage painful emotions and decrease conflict in relationships. DBT specifically focuses on providing therapeutic skills in four key areas. First, mindfulness focuses on improving an individual\'s ability to accept and be present in the current moment. Second, distress tolerance is geared toward increasing a persons tolerance of negative emotion, rather than trying to escape from it. Third, emotion regulation covers strategies to manage and change intense emotions that are causing problems in a persons life. Fourth, interpersonal effectiveness consists of techniques that allow a person to communicate with others in a way that is assertive, maintains self-respect, and strengthens relationships. To read more about Dialectical Behavioral Therapy (DBT), click on the following link:\nhttps://www.psychologytoday.com/us/therapy-types/dialectical-behavior-therapy','776300774492735','www.accessmha.com',NULL,'Not vetted','1240410422818771,1203772244712309,927196575193538,1009514155552809,1174330362614495,554388805123029,973043712374470,884876263410314,770867467503452,953269632165882,1309246678478896,9877520705',NULL,NULL,NULL,NULL,NULL,'637911491907869',NULL,'1145634854238262','639387097779678,791587286497701,1297919866260619,789421862693567,771052077935881,968949207637259,616815450655447,1213394553614190,1242514362876733','1007541826087524','3/6/2019 15:27:59',NULL),(203,972689058438227,'Sexual Issues',NULL,600407365797872,NULL,'1114721937397983','http://www.yapinc.org/',NULL,'Not vetted','1003468187388912,1289367717251475,995785000610087',NULL,NULL,NULL,NULL,NULL,'1155064651413505',NULL,'1143267406656032','639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,616815450655447','1244119270909154','3/20/2019 14:05:30',NULL),(204,987129668562491,'Anxiety',NULL,1258030347645238,'Anxiety is a chronic condition characterized by an excessive and persistent sense of apprehension, with physical symptoms such as sweating, palpitations, and feelings of stress. For more information, click the following link:\nhttps://www.psychologytoday.com/us/conditions/generalized-anxiety-disorder','712300758206965','https://www.facebook.com/qandrconsultationservicesllc/',NULL,'Not vetted','1240410422818771,1203772244712309,756352161259882,1174330362614495,554388805123029,884876263410314,840789512773778,779626884775672,770305239417855,1191545197302694,1178423577607421,1097885029',NULL,NULL,NULL,NULL,NULL,'1280430268019655','1239940828837483','1291078742541334','639387097779678,771052077935881,968949207637259,689909481504179,618650255730163,890080428886480,910547125138880,616815450655447,1213394553614190,821622375158469,1197045062186443,1297919866260','1260350870291637','3/12/2019 15:05:08',NULL),(205,10087