213394553614190,1242514362876733','1007541826087524','3/6/2019 15:27:59',NULL),(235,1103881312064906,'Youth Behavioral Health Assessment',NULL,970550221345922,NULL,'606446291511615','https://www.epact-inc.com/',NULL,'Not vetted','1003468187388912,1282080171129447',NULL,NULL,NULL,NULL,NULL,'1262607973454058',NULL,NULL,'1242514362876733','1073492717210337',NULL,NULL),(236,1103726882919440,'IEP Management',NULL,1094401029893949,'An Individualized Education Plan (or Program) is also known as an IEP. This is a plan or program developed to ensure that a child with an identified disability who is attending an elementary or secondary educational institution receives specialized instruction and related services. The IEP is developed by a team of individuals from various educational disciplines, the child with a disability, family members, and/or designated advocates.\nAn IEP typically includes the following:\n*The involvement and progress of the child with a disability in the general curriculum.\n*All related services for which the child qualifies.\n*Appropriate educational accommodations necessary for the child to   be successful.\n*The child\'s present levels of educational performance.\n*Measurable annual goals and objectives for the child\'s education.','649379739448609','https://www.myviewpointhealth.org/about/programs-a-to-z/','susan.gattman@vphealth.org','Vetting In Progress',NULL,NULL,NULL,NULL,NULL,NULL,'1040192431403484',NULL,'1095457030682112','639387097779678,915499537874128,616815450655447,953369181551142,1213394553614190,1022757596728517,1242514362876733,1118923838832231,856368601852487,748116754740747,593506918155739,63918492060',NULL,NULL,NULL),(237,1102485622589090,'Youth Hoarding ',NULL,567977363172359,NULL,'958018420884621','https://npino.com/behavioral-health/1467990119-introspection-&-reflection/',NULL,'Not vetted','751209368821784,1240410422818771,1203772244712309,790497382892263,748835921605420,814367410605790,820330329667220,589472247873238,8346611385