27',NULL,NULL,NULL,'1315949018963376',NULL,NULL),(273,1194806974194579,'Case Management',NULL,732833359260751,'Case management is a service for individuals in their homes, or other places in the community, to support recovery efforts. Caseloads are usually limited to 30 individuals per staff member. These services are adjunct to the Core Services individuals receive and are designed to foster successful living in the community. ','1052979040721473','http://gahealthpartners.com/',NULL,'Not vetted','1240410422818771,1203772244712309,589472247873238,834661138587154,1146502286863512,1174330362614495,554388805123029,884876263410314,1095552548215797,840789512773778,1191545197302694,634390495',NULL,NULL,NULL,NULL,NULL,'1005138863537264',NULL,NULL,'1095053765654102,639387097779678,789421862693567,988970636517896,1193781551435948,1149777292769951,1160063855866694,618650255730163,1207857486716732,573698134502315,890080428886480,1247220421','1152570902873872','3/6/2019 16:09:43',NULL),(274,1146598424073431,'Youth Behavior Consultation',NULL,1258030347645238,NULL,'712300758206965','https://www.facebook.com/qandrconsultationservicesllc/',NULL,'Not vetted','1240410422818771,1203772244712309,756352161259882,1174330362614495,554388805123029,884876263410314,840789512773778,779626884775672,770305239417855,1191545197302694,1178423577607421,1097885029',NULL,NULL,NULL,NULL,NULL,'1280430268019655','1239940828837483','1291078742541334','639387097779678,771052077935881,968949207637259,689909481504179,618650255730163,890080428886480,910547125138880,616815450655447,1213394553614190,821622375158469,1197045062186443,1297919866260','1260350870291637','3/12/2019 15:05:08',NULL),(275,1155704876769910,'Depression',NULL,1264690864853116,'Depression is a mood disorder that causes a persistent feeling of sadness and loss of interest. Also called major depressive disorder or clinical depression, it affects how you feel, think and behave and can lead to a variety of emotional and physical problems. For more information, click the following link:\nhttps://www.psychologytoday.com/us/basics/depression','574794009437158','http://www.georgiaoutreach.com/personnel/ashley-richbourg-lcsw/',NULL,'Not vetted','1097885029940814,1240410422818771,884876263410314,1203772244712309,1146502286863512,834661138587154,814367410605790,1174330362614495',NULL,NULL,NULL,NULL,NULL,'1000710924307359',NULL,'848899122442716','639387097779678,1213394553614190,953369181551142,987463381209808,616815450655447','1121486060644435',NULL,NULL),(276,1168468384481655,'Individual Counseling',NULL,970550221345922,NULL,'606446291511615','https://www.epact-inc.com/',NULL,'Not vetted','1003468187388912,1282080171129447',NULL,NULL,NULL,NULL,NULL,'1262607973454058',NULL,NULL,'1242514362876733','1073492717210337',NULL,NULL),(277,1170627377907579,'Cognitive Behavioral Therapy','CBT',903011084269923,'Cognitive Behavioral therapy is an action-oriented form of psychosocial therapy that assumes that maladaptive, or faulty, thinking patterns cause maladaptive behavior and \"negative\" emotions. (Maladaptive behavior is behavior that is counter-productive or interferes with everyday living.) The treatment focuses on changing an individual\'s thoughts (cognitive patterns) in order to change his or her behavior and emotional state.\nFor more information, click on the following link:\nhttps://www.psychologytoday.com/us/basics/cognitive-behavioral-therapy','987312017916323','https://www.psychologytoday.com/us/therapists/melanie-mills-savannah-ga/95453',NULL,'Not vetted','1240410422818771,1002100520878338,790497382892263,633127587151884,1146502286863512,607830862982748,1039361098841116,973043712374470,589472247873238,666142468264925,974194458320592,82033032966',NULL,NULL,NULL,NULL,NULL,'1223963668955517',NULL,'661564729925858','639387097779678,616815450655447,953369181551142,1213394553614190,1160063855866694,573698134502315,890080428886480,1247220421586706,1224288192870809,1243892237514253,675333962875133,6164868243','9