clude the depressive disorders (e.g., MAJOR DEPRESSIVE DISORDER, DYSTHYMIC DISORDER), the BIPOLAR DISORDERS, MOOD DISORDERS DUE TO A GENERAL MEDICAL CONDITION, SUBSTANCE-INDUCED mood disorder, and not otherwise specified, which does not meet the diagnostic criteria for any of the specific mood disorders. Mood disorders can affect both females and males equally- they typically become noticeable after life events shock an individual into mood or depressive disorders. For more information, click the following link: https://www.mayoclinic.org/diseases-conditions/mood-disorders/symptoms-causes/syc-20365057','1052979040721473','http://gahealthpartners.com/',NULL,'Not vetted','1240410422818771,1203772244712309,589472247873238,834661138587154,1146502286863512,1174330362614495,554388805123029,884876263410314,1095552548215797,840789512773778,1191545197302694,634390495',NULL,NULL,NULL,NULL,NULL,'1005138863537264',NULL,NULL,'1095053765654102,639387097779678,789421862693567,988970636517896,1193781551435948,1149777292769951,1160063855866694,618650255730163,1207857486716732,573698134502315,890080428886480,1247220421','1152570902873872','3/6/2019 16:09:43',NULL),(314,1226301155203197,'Anxiety',NULL,600407365797872,'Anxiety is a chronic condition characterized by an excessive and persistent sense of apprehension, with physical symptoms such as sweating, palpitations, and feelings of stress. For more information, click the following link:\nhttps://www.psychologytoday.com/us/conditions/generalized-anxiety-disorder','1114721937397983','http://www.yapinc.org/',NULL,'Not vetted','1003468187388912,1289367717251475,995785000610087',NULL,NULL,NULL,NULL,NULL,'1155064651413505',NULL,'1143267406656032','639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,616815450655447','1244119270909154','3/20/2019 14:05:30',NULL),(315,1238724545558502,'Family Counseling',NULL,1066842143635008,NULL,'624872025396095','http://www.joyepsychology.com/',NULL,'Not vetted','100346818738