ems may be diagnosed with PTSD. People who have PTSD may feel stressed or frightened even when they are not in danger. For more information concerning PTSD, click on the following link:\nhttps://www.psychologytoday.com/us/blog/the-resilient-brain/201903/trauma-and-ptsd-more-common-you-think','1052979040721473','http://gahealthpartners.com/',NULL,'Not vetted','1240410422818771,1203772244712309,589472247873238,834661138587154,1146502286863512,1174330362614495,554388805123029,884876263410314,1095552548215797,840789512773778,1191545197302694,634390495',NULL,NULL,NULL,NULL,NULL,'1005138863537264',NULL,NULL,'1095053765654102,639387097779678,789421862693567,988970636517896,1193781551435948,1149777292769951,1160063855866694,618650255730163,1207857486716732,573698134502315,890080428886480,1247220421','1152570902873872','3/6/2019 16:09:43',NULL),(336,1294319732267669,'Intensive Family Intervention- IFI',NULL,732833359260751,NULL,'1052979040721473','http://gahealthpartners.com/',NULL,'Not vetted','1240410422818771,1203772244712309,589472247873238,834661138587154,1146502286863512,1174330362614495,554388805123029,884876263410314,1095552548215797,840789512773778,1191545197302694,634390495',NULL,NULL,NULL,NULL,NULL,'1005138863537264',NULL,NULL,'1095053765654102,639387097779678,789421862693567,988970636517896,1193781551435948,1149777292769951,1160063855866694,618650255730163,1207857486716732,573698134502315,890080428886480,1247220421','1152570902873872','3/6/2019 16:09:43',NULL),(337,1297177713438027,'Parenting Services',NULL,857524097390237,NULL,'983268101472067','https://barnabascenter.net/counselors/',NULL,'Not vetted','1282080171129447,884876263410314,1240410422818771,1146502286863512,834661138587154,1019218787740671,1203772244712309,814367410605790,820330329667220,1224065867035634',NULL,NULL,NULL,NULL,NULL,'1275228658146727',NULL,'975971103048489','639387097779678,1213394553614190,616815450655447,953369181551142,675333962875133,1193781551435948,987463381209808,818831669488442,