 upon the circumstances of the death, but grief is a normal, healthy response to loss. Feelings of bereavement can also accompany other losses, such as the decline of one\'s health or the health of a close other, or the end of an important relationship.\nRead more about it: https://www.psychologytoday.com/us/conditions/bereavement','958018420884621','https://npino.com/behavioral-health/1467990119-introspection-&-reflection/',NULL,'Not vetted','751209368821784,1240410422818771,1203772244712309,790497382892263,748835921605420,814367410605790,820330329667220,589472247873238,834661138587154,1039361098841116,655863929386813,117433036261',NULL,NULL,NULL,NULL,NULL,'785541576275303','1239940828837483,1185806972759577','1263119709592773','639387097779678,789421862693567,771052077935881,968949207637259,988970636517896,618650255730163,890080428886480,1321861983203612,616815450655447,953369181551142,1213394553614190','783064209583387','3/12/2019 14:34:33',NULL),(345,1267389878281054,'Anxiety',NULL,908935519698397,'Anxiety is a chronic condition characterized by an excessive and persistent sense of apprehension, with physical symptoms such as sweating, palpitations, and feelings of stress. For more information, click the following link:\nhttps://www.psychologytoday.com/us/conditions/generalized-anxiety-disorder','827392117018258','https://www.statesboropsych.com/contact-us/',NULL,'Not vetted','927196575193538,1009514155552809,770867467503452,834661138587154,1146502286863512,666142468264925,1087821211043828,633127587151884,974194458320592,1226867632374211',NULL,NULL,NULL,NULL,NULL,'911949867147692',NULL,'1162485668871511','639387097779678,1213394553614190,616815450655447,953369181551142,1160063855866694,618650255730163,890080428886480,1254253296739887,636015951022686','1129664860333409',NULL,NULL),(346,1283729751742050,'Holistic Approach',NULL,887938623409132,NULL,'991433071763078','http://hopecounseling.center/',NULL,'Not vetted','1240410422818771,1203772244712309,1224065867035634,979551410768146,1145089114996156,790497382892263,820330329667220,919448866150716,1106581118915979,1174330362614495,554388805123029,123043153',NULL,NULL,NULL,NULL,NULL,'584003418223973',NULL,'1045777867810878','639387097779678,771052077935881,968949207637259,988970636517896,689909481504179,1149777292769951,1160063855866694,618650255730163,890080428886480,1243892237514253,578290825124982,785935366286','1009042032512685','3/12/2019 14:23:58',NULL),(347,1288039132023961,'Parent Support',NULL,1258030347645238,NULL,'712300758206965','https://www.facebook.com/qandrconsultationservicesllc/',NULL,'Not vetted','1240410422818771,1203772244712309,756352161259882,1174330362614495,554388805123029,884876263410314,840789512773778,779626884775672,770305239417855,1191545197302694,1178423577607421,1097885029',NULL,NULL,NULL,NULL,NULL,'1280430268019655','1239940828837483','1291078742541334','639387097779678,771052077935881,968949207637259,689909481504179,618650255730163,890080428886480,910547125138880,616815450655447,1213394553614190,821622375158469,1197045062186443,1297919866260','1260350870291637','3/12/2019 15:05:08',NULL),(348,1290678254463000,'Case Management',NULL,600407365797872,'Case management is a service for individuals in their homes, or other places in the community, to support recovery efforts. Caseloads are usually limited to 30 individuals per staff member. These services are adjunct to the Core Services individuals receive and are designed to foster successful living in the community. ','1114721937397983','http://www.yapinc.org/',NULL,'Not vetted','1003468187388912,1289367717251475,995785000610087',NULL,NULL,NULL,NULL,NULL,'1155064651413505',NULL,'1143267406656032','639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,616815450655447','1244119270909154','3/20/2019 14:05:30',NULL),(349,1318373996342348,'Trauma Focused Cognitive Behavioral Therapy','TF-CBT',1339182713147731,'TF-CBT is a structured, short-term treatment model that effectively improves a range of trauma-related outcomes in 8-25 sessions with the child/adolescent and caregiver. Although TF-CBT is highly effective at improving youth posttraumatic stress disorder (PTSD) symptoms and diagnosis, a PTSD diagnosis is not required in order to receive this treatment. TF-CBT also effectively addresses many other trauma impacts, including affective (e.g., depressive, anxiety), cognitive and behavioral problems, as well as improving the participating parents or caregivers personal distress about the childs traumatic experience, effective parenting skills, and supportive interactions with the child.\nFor more information, click on the following link:\nhttps://www.psychologytoday.com/us/therapy-types/trauma-focused-cognitive-behavior-therapy','680724149779279','https://www.psychologytoday.com/us/therapists/trauma-drama-therapy-savannah-ga/154733','lrumpel@traumadrama.us','Vetting In Progress','1003468187388912,751209368821784,790497382892263,1039361098841116',NULL,NULL,NULL,NULL,NULL,'1225987825999811',NULL,'588559626701281','639387097779678,1297919866260619,789421862693567,771052077935881,988970636517896,675333962875133,915499537874128,944379166032449,818831669488442,616815450655447,953369181551142,12133945536141','799761410070077','3/20/2019 13:48:05',NULL),(350,1284633846797625,'Mood Disorders',NULL,1325705296267184,'Mood disorder is defined by the DSM (diagnostic statistical manual) as: a psychiatric disorder in which the principal feature is mood disturbance. Mood disorders include the depressive disorders (e.g., MAJOR DEPRESSIVE DISORDER, DYSTHYMIC DISORDER), the BIPOLAR DISORDERS, MOOD DISORDERS DUE TO A GENERAL MEDICAL CONDITION, SUBSTANCE-INDUCED mood disorder, and not otherwise specified, which does not meet the diagnostic criteria for any of the specific mood disorders. Mood disorders can affect both females and males equally- they typically become noticeable after life events shock an individual into mood or depressive disorders. For more information, click the following link: https://www.mayoclinic.org/diseases-conditions/mood-disorders/symptoms-causes/syc-20365057','785753978316869','https://barnabascenter.net/counselors/',NULL,'Not vetted','1240410422818771,1146502286863512,834661138587154,919448866150716,1203772244712309,554388805123029,884876263410314,1089812308968087',NULL,NULL,NULL,NULL,NULL,'1275228658146727',NULL,'788710545598112','639387097779678,1213394553614190,987463381209808,953369181551142,616815450655447,890080428886480,1160854949421677,636015951022686,1243892237514253,689909481504179,797229853250820,122428819287','1315949018963376',NULL,NULL),(351,1289467219593544,'Anxiety',NULL,903011084269923,'Anxiety is a chronic condition characterized by an excessive and persistent sense of apprehension, with physical symptoms such as sweating, palpitations, and feelings of stress. For more information, click the following link:\nhttps://www.psychologytoday.com/us/conditions/generalized-anxiety-disorder','987312017916323','https://www.psychologytoday.com/us/therapists/melanie-mills-savannah-ga/95453',NULL,'Not vetted','1240410422818771,1002100520878338,790497382892263,633127587151884,1146502286863512,607830862982748,1039361098841116,973043712374470,589472247873238,666142468264925,974194458320592,82033032966',NULL,NULL,NULL,NULL,NULL,'1223963668955517',NULL,'661564729925858','639387097779678,616815450655447,953369181551142,1213394553614190,1160063855866694,573698134502315,890080428886480,1247220421586706,1224288192870809,1243892237514253,675333962875133,6164868243','919840987033296',NULL,NULL),(352,1306972062481466,'Anger Management',NULL,1264690864853116,'Therapeutic interventions that help an individual identify and manage the expression of anger- making the expression appropriate and respectful to others. ','574794009437158','http://www.georgiaoutreach.com/personnel/ashley-richbourg-lcsw/',NULL,'Not vetted','1097885029940814,1240410422818771,884876263410314,1203772244712309,1146502286863512,8