a persistent feeling of sadness and loss of interest. Also called major depressive disorder or clinical depression, it affects how you feel, think and behave and can lead to a variety of emotional and physical problems. For more information, click the following link:\nhttps://www.psychologytoday.com/us/basics/depression','983268101472067','https://barnabascenter.net/counselors/',NULL,'Not vetted','1282080171129447,884876263410314,1240410422818771,1146502286863512,834661138587154,1019218787740671,1203772244712309,814367410605790,820330329667220,1224065867035634',NULL,NULL,NULL,NULL,NULL,'1275228658146727',NULL,'975971103048489','639387097779678,1213394553614190,616815450655447,953369181551142,675333962875133,1193781551435948,987463381209808,818831669488442,890080428886480,1224288192870809,1160063855866694,94597836827','1262420945163898',NULL,NULL),(356,1308672176210939,'Weekend Activities',NULL,1112271443337891,NULL,'754649737705617','www.gatewaybhs.org',NULL,'Not vetted','1240410422818771,1203772244712309,877056620750945,1009514155552809,1174330362614495,1230431537610570,884876263410314,770867467503452,1172570269569144,1076768128765048,1191545197302694,6343904',NULL,NULL,NULL,NULL,NULL,'854685172508860','1114986783482614,1239940828837483,1185806972759577','959714851720583','639387097779678,791587286497701,578514860857586,1297919866260619,771052077935881,968949207637259,618650255730163,915499537874128,616815450655447,1213394553614190','834050775421568','3/6/2019 15:38:51',NULL),(357,1327551367300583,'Youth Substance Abuse Therapy',NULL,888435226473868,NULL,'1197180011238880','www.mgacommunityservices.com',NULL,'Not vetted','1003468187388912,751209368821784,1240410422818771,1203772244712309,1002100520878338,1289367717251475,1009514155552809,748835921605420,1039361098841116,791691614771819,793274560277759,85832866',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'882026281098116','639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,988970636517896,11937